INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (1, 0, "", 1, 1, 1, "カリン", 190804, 60000, 0, 0, "新年を迎え、新たに始まる一日を\nおみくじで占ってみませんか？\n良い運勢であるほど、\n沢山のプレゼントが貰えますよ♪");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (2, 0, "", 0, 1, 2, "", 0, 60000, 1, 0, "今日の運勢は姫吉！　あらゆる運気が最大を示しています！　　　今なら「伝説の吸血鬼」をも従え、世界征服も夢じゃありません！");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (2, 0, "", 0, 1, 3, "", 0, 60000, 1, 0, "今日の運勢は姫吉！　やること全てが最高潮！　やばいですね☆　ラッキーアイテムはおにぎり！　お腹一杯で幸せが続くでしょう！");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (2, 0, "", 0, 2, 4, "", 0, 60000, 1, 0, "今日の運勢は姫吉！　その高い運気はまさにショーグンの如く！　その溢れる威光は人々を惹きつけ、皆の人気者間違いなしです！");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (2, 0, "", 0, 1, 5, "", 0, 60000, 2, 0, "今日の運勢は大吉！　運気がどんどん高まっています！　　　　　何をやっても、最大効率で素晴らしい結果になりますよ♪");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (2, 0, "", 0, 1, 6, "", 0, 60000, 2, 0, "今日の運勢は大吉！　なにをやっても上手くいって大活躍！　　　そんな素敵なあなたを見て、後ろから誰かが……クスクス♪");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (2, 0, "", 0, 2, 7, "", 0, 60000, 2, 0, "今日の運勢は大吉！　運気が高く、何かに挑戦すると良い結果に！隠れた才能が引き出されそう！　目指せヒデサ……ではなく秀才！");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (2, 0, "", 0, 1, 8, "", 0, 60000, 3, 0, "今日の運勢は中吉！　商売運が上がってきています！　　　　　　ラッキーアイテムはたいやき！　和菓子パワーで売上アップです！");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (2, 0, "", 0, 1, 9, "", 0, 60000, 3, 0, "今日の運勢は中吉！　旅行運がぐんぐんと上昇中♪　　　　　　　もしかしたら、あの「マホマホ王国」にだって行けるかも♪");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (2, 0, "", 0, 1, 10, "", 0, 60000, 3, 0, "今日の運勢は中吉！　仕事運が急上昇中です！　　　　　　　　　きっと「煉獄に舞う一陣の疾風」の如き活躍ができますよ！");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (2, 0, "", 0, 1, 11, "", 0, 60000, 3, 0, "今日の運勢は中吉！　チャンスを待つと良い結果に！　　　　　　ラッキーアイテムのプリンを食べて、運を呼び込みましょう！");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (2, 0, "", 0, 2, 12, "", 0, 60000, 3, 0, "今日の運勢は中吉！　運気が着々と上昇中！　　　　　　　　　　精霊の加護を受けたかの如く、色々な事がうまくいきますよ♪");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (2, 0, "", 0, 1, 13, "", 0, 60000, 4, 0, "今日の運勢は小吉！　早朝に幸運の兆しあり！　　　　　　　　　もしかしたら、優しいお姉ちゃんが起こしにきてくれますよ♪");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (2, 0, "", 0, 1, 14, "", 0, 60000, 4, 0, "今日の運勢は小吉！　運気上昇中ですが、上がるまでが要注意！　ラッキーアニマルは熊！　本当の家族のように守ってくれるかも♪");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (2, 0, "", 0, 1, 15, "", 0, 60000, 4, 0, "今日の運勢は小吉！　外に出てゆっくり過ごすと運気が上昇！　　ラッキースポットは牧場。面白い出会いがありそうです♪");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (2, 0, "", 0, 1, 16, "", 0, 60000, 4, 0, "今日の運勢は小吉！　運気は高いけども、ハプニングには注意！　出かけた先で、「ふしんしゃ」扱いされてしまうかも……");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (2, 0, "", 0, 2, 17, "", 0, 60000, 4, 0, "今日の運勢は小吉！　根を詰めずにリラックスすると運気向上！　ラッキーパーソンはアイドル。歌があなたを幸せにしてくれます♪");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (3, 0, "", 2, 0, 18, "カリン", 190804, 60000, 0, 0, "おみくじの結果はどうでしたか？\n新たに始まる一日が、あなたに\nとって良い日になりますように\nまた明日も遊びに来て下さいね♪");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (3, 7, "", 3, 0, 19, "カリン", 190804, 60000, 0, 0, "おみくじは楽しんで頂けましたか？\nあなたの新たなる年が\n素晴らしいものになるよう、\n心からお祈りいたします");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (0, 1, "", 1, 0, 20, "ハツネ", 101201, 80001, 0, 0, "キミと出会ってもう\n1年もたつんだね！\nう～ん、いつも\n寝てばっかりだから、");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (0, 1, "", 2, 0, 21, "ハツネ", 101201, 80001, 0, 0, "少しでも\n寝る時間を減らして\nキミと一緒にいる\n時間増やしたいなぁ♪");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (1, 1, "", 1, 0, 22, "シオリ", 103801, 80001, 0, 0, "あなたと知り合ってから\nもう1年…\n時がたつのは\n早いですね");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (1, 1, "", 2, 0, 23, "シオリ", 103801, 80001, 0, 0, "来年も、\n一緒にいられたら…\nうれしいな");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (0, 2, "", 1, 0, 24, "キョウカ", 103601, 80001, 0, 0, "あなたと一緒にいるようになって、\nもう1年ですか…");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (0, 2, "", 2, 0, 25, "キョウカ", 103601, 80001, 0, 0, "最初の頃よりも、頼もしく\nなりましたね。私はどうですか？\n成長していますか？");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (1, 2, "", 1, 0, 26, "ミミ", 102001, 80001, 0, 0, "おにいちゃんとあってから、\n1年たったよ～！");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (1, 2, "", 2, 0, 27, "ミミ", 102001, 80001, 0, 0, "ミミね、おにいちゃんと\nいっぱい遊べてたのしかったな～♪\nこれからもずっと\nいっしょにいてね～！");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (2, 2, "", 1, 0, 28, "ミソギ", 100401, 80001, 0, 0, "にいちゃんがミソギのイタズラに\n引っかかり続けてもう1年かぁ");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (2, 2, "", 2, 0, 29, "ミソギ", 100401, 80001, 0, 0, "…これからもいっぱいミソギと\n遊んでね、にいちゃん！");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (0, 3, "", 1, 0, 30, "マホ", 101001, 80001, 0, 0, "もう王子はんと会うてから\n1年ぐらいたつそうどすえ\n早いもんやなあ");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (0, 3, "", 2, 0, 31, "マホ", 101001, 80001, 0, 0, "このままやと、\nうちもあっという間に\n干からびてしまいそうどすえ\nなーんてな。うふふ");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (1, 3, "", 1, 0, 32, "イリヤ", 104401, 80001, 0, 0, "お主と会って早1年じゃな\nこれからも存分に尽くすがよい");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (1, 3, "", 2, 0, 33, "イリヤ", 104401, 80001, 0, 0, "わらわもたまには、お主の献身に\n報いてやらぬでもない♪");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (2, 3, "", 1, 0, 34, "カオリ", 101701, 80001, 0, 0, "もう、キミと出会って結構な時間が\nたつさ～。でも、私たちの旅は\nまだまだ始まったばかりさ～！");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (2, 3, "", 2, 0, 35, "カオリ", 101701, 80001, 0, 0, "これからも、どうぞよろしく\nお願いするさ～！");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (0, 4, "", 1, 0, 36, "サレン", 102801, 80001, 0, 0, "あんたと出会ってからもうそんなに\nたつのね～");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (0, 4, "", 2, 0, 37, "サレン", 102801, 80001, 0, 0, "あっという間だったって感じるほど\n楽しかったわ！\nこれからも一緒に頑張りましょ！");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (1, 4, "", 1, 0, 38, "スズメ", 102501, 80001, 0, 0, "出会ってから1年間、ずっと\nご迷惑をかけっぱなしで、\nすみません…");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (1, 4, "", 2, 0, 39, "スズメ", 102501, 80001, 0, 0, "これからはもっと頑張りますから\n見ていてくださいね\nできれば…\n今までよりも、私の近くで♪");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (0, 5, "", 1, 0, 40, "タマキ", 104601, 80001, 0, 0, "振り返れば、今までいろんなことが\nあったにゃあ…");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (0, 5, "", 2, 0, 41, "タマキ", 104601, 80001, 0, 0, "これからも、二人でたくさんの\n思い出をがっぽり作っていく\nにゃー！");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (1, 5, "", 1, 0, 42, "ミフユ", 104801, 80001, 0, 0, "キミとの師弟関係も、\nもう1年なのね…\nでもキミに教えることは、");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (1, 5, "", 2, 0, 43, "ミフユ", 104801, 80001, 0, 0, "まだまだいっぱいあるわ\nこれからも、\nしっかりついて来てね！");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (0, 6, "", 1, 0, 44, "アキノ", 103201, 80001, 0, 0, "あなたさまと出会ってもう1年…");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (0, 6, "", 2, 0, 45, "アキノ", 103201, 80001, 0, 0, "光陰矢のごとし、とはまさに\nこのことですわ。…思い出は決して\nお金では買えませんわね");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (1, 6, "", 1, 0, 46, "ユカリ", 103401, 80001, 0, 0, "ダメな私を1年間も見捨てないで\nくれて、本当にありがとう");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (1, 6, "", 2, 0, 47, "ユカリ", 103401, 80001, 0, 0, "情けないところいっぱいみせるかも\nしれないけど、これからも一緒に\nいてくれると、うれしいな");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (0, 7, "", 1, 0, 48, "クリスティーナ", 107101, 80001, 0, 0, "オマエと出会ってもう1年か\nまさかこのワタシの結婚相手に\nなろうとはな…");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (0, 7, "", 2, 0, 49, "クリスティーナ", 107101, 80001, 0, 0, "ともかくこれからも\n愉しませてくれよ☆");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (1, 7, "", 1, 0, 50, "ジュン", 104701, 80001, 0, 0, "君と出会ってからもう1年か。\n以前と比べて私の表情もいくらか\n柔らかくなった気がするんだが、\nどうだろう？");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (1, 7, "", 2, 0, 51, "ジュン", 104701, 80001, 0, 0, "見えないから分からないって？\nそれもそうだな…");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (0, 8, "", 1, 0, 52, "トモ", 103701, 80001, 0, 0, "もう1年たったみたいだね\nあなたをからかってばかりだった\nけど、楽しかった♪");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (0, 8, "", 2, 0, 53, "トモ", 103701, 80001, 0, 0, "これからもよろしくね！");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (1, 8, "", 1, 0, 54, "マツリ", 100501, 80001, 0, 0, "出会って、もう1年たっちゃった\nんスね。なんだか意外ッス");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (1, 8, "", 2, 0, 55, "マツリ", 100501, 80001, 0, 0, "毎日楽しくて、あっという間に過ぎ\nちゃったみたいなんスよね\nこれからも一緒に悪と戦うッス！");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (0, 9, "", 1, 0, 56, "ミヤコ", 100701, 80001, 0, 0, "オマエと会って1年なの！\n全然成仏もできなかったし、");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (0, 9, "", 2, 0, 57, "ミヤコ", 100701, 80001, 0, 0, "生き返りもしなかったけど、\nすごく楽しかったの～♪\nオマエとプリンがあれば、\nミヤコはハッピーなの～♪");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (1, 9, "", 1, 0, 58, "シノブ", 103101, 80001, 0, 0, "あなたと出会って1年なんですね\nでも、私の占いでは、私とあなたは");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (1, 9, "", 2, 0, 59, "シノブ", 103101, 80001, 0, 0, "来年も再来年も一緒にいるようです\nふふ、よろしくお願いしますね");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (0, 10, "", 1, 0, 60, "アンナ", 100901, 80001, 0, 0, "貴様が閃光のシグルドとして覚醒し\nもう1年か…。これからも我らの\n長き戦いに終わりはないが、");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (0, 10, "", 2, 0, 61, "アンナ", 100901, 80001, 0, 0, "それでも貴様となら…\n添い遂げる覚悟はできているぞ！");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (1, 10, "", 1, 0, 62, "ナナカ", 101301, 80001, 0, 0, "君と出会ってもう1年だって！\n早いねー！");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (1, 10, "", 2, 0, 63, "ナナカ", 101301, 80001, 0, 0, "これからも最強のバディタッグで\n大活躍だー！\n頼りにしてるよ、相棒！");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (0, 11, "", 1, 0, 64, "ミツキ", 105101, 80001, 0, 0, "1年たつのって、あっという間ね\nまだまだ君の知らない部分が\nたくさんあるし…");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (0, 11, "", 2, 0, 65, "ミツキ", 105101, 80001, 0, 0, "これからも、いろんなところを\n調べさせてね？");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (1, 11, "", 1, 0, 66, "ルカ", 105601, 80001, 0, 0, "お前さんと出会ってもう1年か\n助太刀するつもりが");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (1, 11, "", 2, 0, 67, "ルカ", 105601, 80001, 0, 0, "逆に助けられたりもしたね\nこれからもよろしく頼むよ！");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (2, 11, "", 1, 0, 68, "エリコ", 102701, 80001, 0, 0, "早いものですわね、あなた様と\nお会いして、もう1年…");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (2, 11, "", 2, 0, 69, "エリコ", 102701, 80001, 0, 0, "あなた様といると、時があっと\nいう間に過ぎてしまいます\n時間を止める研究をしなくては\nいけませんね…");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (0, 12, "", 1, 0, 70, "アヤネ", 102301, 80001, 0, 0, "お兄ちゃんと会ってから、もう、\n1年なんだね。私、少しは\nお姉ちゃんっぽくなったかな？");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (0, 12, "", 2, 0, 71, "アヤネ", 102301, 80001, 0, 0, "あ、ぷうきちもお兄ちゃんっぽく\nなったよね？");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (1, 12, "", 1, 0, 72, "チカ", 104201, 80001, 0, 0, "あなたと出会って、\nもう1年がたったんですね…\nこれからもそばにいて、");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (1, 12, "", 2, 0, 73, "チカ", 104201, 80001, 0, 0, "私のことを見守ってください\nできることなら、ずっと…");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (2, 12, "", 1, 0, 74, "クルミ", 102101, 80001, 0, 0, "お兄ちゃんと出会って1年かぁ\n私、相変わらずダメダメで…");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (2, 12, "", 2, 0, 75, "クルミ", 102101, 80001, 0, 0, "で、でもこれからもずっと…\n一緒にいたいなぁ…");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (0, 13, "", 1, 0, 76, "シズル", 104901, 80001, 0, 0, "再会してちょうど1年だね\nお祝いにごちそう作ってきたよ～♪\n特製ケーキと、お寿司と、");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (0, 13, "", 2, 0, 77, "シズル", 104901, 80001, 0, 0, "ハンバーグと、カレーと、\nシチューと、あ、隠しきれない隠し\n味は、お姉ちゃんの愛情だよ！");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (1, 13, "", 1, 0, 78, "リノ", 101101, 80001, 0, 0, "お兄ちゃんと再会して、もう1年\nなんですね。\n会えなかった時を思うと、");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (1, 13, "", 2, 0, 79, "リノ", 101101, 80001, 0, 0, "信じられないくらい幸せな1年\nでした！もう絶対、私から離れ\nないでくださいね♪");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (0, 14, "", 1, 0, 80, "ユイ", 100201, 80001, 0, 0, "騎士クンと出会ってから今まで、\nいろんなことがあったよね\n楽しいこと、ドキドキしたこと…");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (0, 14, "", 2, 0, 81, "ユイ", 100201, 80001, 0, 0, "そんな日々をこれからも、\nず、ずっと一緒に…\n過ごしていきたいな…！");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (1, 14, "", 1, 0, 82, "ヒヨリ", 100101, 80001, 0, 0, "騎士くんと出会って、まだ1年しか\nたってないんだ！？");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (1, 14, "", 2, 0, 83, "ヒヨリ", 100101, 80001, 0, 0, "なんかもうずっと一緒にいる気が\nするなぁ…えへへ。これからの\n1年もまたよろしくねっ！\n騎士くん！");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (2, 14, "", 1, 0, 84, "レイ", 100301, 80001, 0, 0, "初めてキミに出会って1年…\n随分見違えたね私もキミも、\n更に強くなっていく…");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (2, 14, "", 2, 0, 85, "レイ", 100301, 80001, 0, 0, "キミに背中を預けられる日が、\n早くきますように");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (0, 15, "", 1, 0, 86, "ペコリーヌ", 105801, 80001, 0, 0, "1年もわたしのことを、忘れない\nでいてくれて、ありがとうござい\nます！");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (0, 15, "", 2, 0, 87, "ペコリーヌ", 105801, 80001, 0, 0, "これからもずっと、覚えていて\nくださいね！");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (1, 15, "", 1, 0, 88, "コッコロ", 105901, 80001, 0, 0, "こうして1年も、主さまのおそばに\n置いていただけて、とても光栄\nです。どうかこれからも、");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (1, 15, "", 2, 0, 89, "コッコロ", 105901, 80001, 0, 0, "末永く主さまをお世話させて\nください。わたくしは、ずっと\n主さまのガイド役でいたいのです");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (2, 15, "", 1, 0, 90, "キャル", 106001, 80001, 0, 0, "1年か、まっさかこんなに長い\n付き合いになるなんてね～\nでも…わりと楽しい1年だったかも");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (2, 15, "", 2, 0, 91, "キャル", 106001, 80001, 0, 0, "だから、もうしばらくあんたに\n付き合ってやるわよ喜びなさい！");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (1, 0, "", 1, 1, 92, "スズメ", 112101, 60001, 0, 0, "新しい年のはじめに、\nおみくじはいかがでしょうか？\nよい運勢であるほど、\n沢山プレゼントが貰えますよ♪");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (2, 0, "", 0, 1, 93, "", 0, 60001, 1, 0, "今日の運勢は姫吉！　あらゆる運気が最大を示しています！　　　今なら「伝説の吸血鬼」をも従え、世界征服も夢じゃありません！");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (2, 0, "", 0, 1, 94, "", 0, 60001, 1, 0, "今日の運勢は姫吉！　やること全てが最高潮！　やばいですね☆　ラッキーアイテムはおにぎり！　お腹一杯で幸せが続くでしょう！");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (2, 0, "", 0, 1, 95, "", 0, 60001, 1, 0, "今日の運勢は姫吉！　最強の運勢でどんなドジも跳ね除けます！　大切な人と一緒に、最高の一日になること間違いなし！");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (2, 0, "", 0, 1, 96, "", 0, 60001, 1, 0, "今日の運勢は姫吉！　どんな挑戦も上手くいく、最高の運勢です！理想の自分に変身できる絶好の機会！　新しい一歩を踏み出そう！");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (2, 0, "", 0, 2, 97, "", 0, 60001, 1, 0, "今日の運勢は姫吉！　その高い運気はまさにショーグンの如く！　その溢れる威光は人々を惹きつけ、皆の人気者間違いなしです！");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (2, 0, "", 0, 1, 98, "", 0, 60001, 2, 0, "今日の運勢は大吉！　運気がどんどん高まっています！　　　　　何をやっても、最大効率で素晴らしい結果になりますよ♪");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (2, 0, "", 0, 1, 99, "", 0, 60001, 2, 0, "今日の運勢は大吉！　なにをやっても上手くいって大活躍！　　　そんな素敵なあなたを見て、後ろから誰かが……クスクス♪");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (2, 0, "", 0, 1, 100, "", 0, 60001, 2, 0, "今日の運勢は大吉！　ラッキーワードは「ちぇる～ん♪」　　　　出会う人みんなに言ってあげると、ハッピーになれますよ！");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (2, 0, "", 0, 1, 101, "", 0, 60001, 2, 0, "今日の運勢は大吉！　運勢はバッチリで無敵状態！　　　　　　　龍眼で全てを見通して、思い通りの一日を過ごしましょう！");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (2, 0, "", 0, 2, 102, "", 0, 60001, 2, 0, "今日の運勢は大吉！　運気が高く、何かに挑戦すると良い結果に！隠れた才能が引き出されそう！　目指せヒデサ……ではなく秀才！");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (2, 0, "", 0, 1, 103, "", 0, 60001, 3, 0, "今日の運勢は中吉！　商売運が上がってきています！　　　　　　ラッキーアイテムはたいやき！　和菓子パワーで売上アップです！");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (2, 0, "", 0, 1, 104, "", 0, 60001, 3, 0, "今日の運勢は中吉！　旅行運がぐんぐんと上昇中♪　　　　　　　もしかしたら、あの「マホマホ王国」にだって行けるかも♪");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (2, 0, "", 0, 1, 105, "", 0, 60001, 3, 0, "今日の運勢は中吉！　仕事運が急上昇中です！　　　　　　　　　きっと「煉獄に舞う一陣の疾風」の如き活躍ができますよ！");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (2, 0, "", 0, 1, 106, "", 0, 60001, 3, 0, "今日の運勢は中吉！　チャンスを待つと良い結果に！　　　　　　ラッキーアイテムのプリンを食べて、運を呼び込みましょう！");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (2, 0, "", 0, 1, 107, "", 0, 60001, 3, 0, "今日の運勢は中吉！　お出かけした先で良縁に恵まれそうです！　ダウナー系あざとい女子が、あま～い飴をくれるかも？");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (2, 0, "", 0, 1, 108, "", 0, 60001, 3, 0, "今日の運勢は中吉！　大抵のことはゴリ押しでなんとかできます！ラッキープレイスはゲーセン。パンチングマシンでストレス発散！");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (2, 0, "", 0, 2, 109, "", 0, 60001, 3, 0, "今日の運勢は中吉！　運気が着々と上昇中！　　　　　　　　　　精霊の加護を受けたかの如く、色々な事がうまくいきますよ♪");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (2, 0, "", 0, 1, 110, "", 0, 60001, 4, 0, "今日の運勢は小吉！　早朝に幸運の兆しあり！　　　　　　　　　もしかしたら、優しいお姉ちゃんが起こしにきてくれますよ♪");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (2, 0, "", 0, 1, 111, "", 0, 60001, 4, 0, "今日の運勢は小吉！　運気上昇中ですが、上がるまでが要注意！　ラッキーアニマルは熊！　本当の家族のように守ってくれるかも♪");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (2, 0, "", 0, 1, 112, "", 0, 60001, 4, 0, "今日の運勢は小吉！　外に出てゆっくり過ごすと運気が上昇！　　ラッキースポットは牧場。面白い出会いがありそうです♪");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (2, 0, "", 0, 1, 113, "", 0, 60001, 4, 0, "今日の運勢は小吉！　運気は高いけども、ハプニングには注意！　出かけた先で、「ふしんしゃ」扱いされてしまうかも……");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (2, 0, "", 0, 1, 114, "", 0, 60001, 4, 0, "今日の運勢は小吉！　同腹一心の友だちが見つかるかも！　　　　キーワードは「ユニちゃんズ」、記憶に刻みましょう！");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (2, 0, "", 0, 1, 115, "", 0, 60001, 4, 0, "今日の運勢は小吉！　思わぬ相手と仲良くなれるかも？　　　　　うっかり毒舌をもらしてしまわないように要注意です！");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (2, 0, "", 0, 2, 116, "", 0, 60001, 4, 0, "今日の運勢は小吉！　根を詰めずにリラックスすると運気向上！　ラッキーパーソンはアイドル。歌があなたを幸せにしてくれます♪");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (3, 0, "", 2, 0, 117, "スズメ", 112101, 60001, 0, 0, "おみくじの結果はいかがでしたか？\n新たに始まる一日が、\nあなたにとってよい日になりますように\n明日もお待ちしていますね♪");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (3, 7, "", 3, 0, 118, "スズメ", 112101, 60001, 0, 0, "おみくじ、楽しんで頂けましたか？\nあなたの新しい年が\n素晴らしいものになるよう、\n心からお祈りしますね");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (0, 1, "", 1, 0, 119, "ペコリーヌ", 105801, 80003, 0, 0, "ヒューヒュー♪\nドンドンパフパフー♪");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (1, 1, "", 1, 0, 120, "コッコロ", 105901, 80003, 0, 0, "ひゅーひゅー\nどんどんぱふぱふー\nでございます");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (1, 1, "", 2, 0, 121, "コッコロ", 105901, 80003, 0, 0, "さぁ、キャルさまもご一緒に\nどんどんぱふぱふいたしましょう");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (2, 1, "", 1, 0, 122, "キャル", 106001, 80003, 0, 0, "え？　ちょっと\nいきなりなにっ？");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (2, 1, "", 2, 0, 123, "キャル", 106001, 80003, 0, 0, "ドンドンパフパフってなんなの？\nあたしにも分かるように\nちゃんと説明しなさいっての！");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (0, 1, "", 2, 0, 124, "ペコリーヌ", 105801, 80003, 0, 0, "実はですねキャルちゃん！\nもうすぐわたしたちにとっての\n大切な節目──");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (0, 1, "", 3, 0, 125, "ペコリーヌ", 105801, 80003, 0, 0, "『プリンセスコネクト！\nRe:Dive』\n2.5周年なんですよ！\nやばいですね☆");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (1, 1, "", 3, 0, 126, "コッコロ", 105901, 80003, 0, 0, "ですからその日に向けて\n今から気分を盛り上げているのです");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (2, 1, "", 3, 0, 127, "キャル", 106001, 80003, 0, 0, "ああ、そういえば\nそんな時期だっけ\nって言っても、もう少し先じゃない\n気が早いんじゃないの？");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (1, 1, "", 4, 0, 128, "コッコロ", 105901, 80003, 0, 0, "いいえ、キャルさま\nこういったお祝いは準備から\n楽しむものでございます\nそうですよね、ペコリーヌさま");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (0, 1, "", 4, 0, 129, "ペコリーヌ", 105801, 80003, 0, 0, "その通りです♪　というわけで！\nカウントダウンの始まりですよ！\nみんなで一緒に2.5周年に向けて\n盛り上がっていきましょー☆");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (2, 1, "", 4, 0, 130, "キャル", 106001, 80003, 0, 0, "ド、ドンドンパフパフ～\nって何言わせんのよ！\nまったくもう、浮かれちゃってさ");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (1, 1, "", 5, 0, 131, "コッコロ", 105901, 80003, 0, 0, "ふふ。キャルさまもワクワクして\nおいでのようですね\nそれでは主さま。大切な記念日まで\nどうぞご期待くださいませ");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (0, 2, "", 5, 0, 132, "キャル", 106001, 80003, 0, 0, "記念日を盛り上げるったって\n一体どうしたらいいのよ？\nあたし、そういうの\n苦手なんだけど…");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (1, 2, "", 1, 0, 133, "カリン", 190801, 80003, 0, 0, "あら、キャルさん\nどうかなさいましたか？\n何かお困りのようですけど");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (0, 2, "", 6, 0, 134, "キャル", 106001, 80003, 0, 0, "げっ…カリンじゃない\nなんでもないわよ！");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (1, 2, "", 2, 0, 135, "カリン", 190801, 80003, 0, 0, "そうなのですか？\nキャルさんのことですからてっきり\n2.5周年をどう盛り上げたら\nいいか悩んでいるのかと…");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (0, 2, "", 7, 0, 136, "キャル", 106001, 80003, 0, 0, "分かってんじゃないのよ！？\nいっ、いや、違うけどね！\nあたしは別にそんなことで\n悩んでないわよっ？");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (1, 2, "", 3, 0, 137, "カリン", 190801, 80003, 0, 0, "ふふっ…\nこういう時は、真心を込めて\n気持ちをそのまま口にしたら\nいいのではないでしょうか？");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (0, 2, "", 8, 0, 138, "キャル", 106001, 80003, 0, 0, "気持ちを、ねぇ\nそれが一番難しいんじゃない…\nそもそも、あたしは記念日とか\n別にどうだっていいし");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (0, 2, "", 9, 0, 139, "キャル", 106001, 80003, 0, 0, "…まあ、ペコリーヌもコロ助も\nやけに楽しそうだったから…\nこういうお祭り騒ぎみたいなのも\nたまにはいいかな、とは思うけど");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (1, 2, "", 4, 0, 140, "カリン", 190801, 80003, 0, 0, "なるほどなるほど～\nキャルさんは【美食殿】で祝う\n2.5周年を心から楽しみに\nしている、ということですね！");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (0, 2, "", 10, 0, 141, "キャル", 106001, 80003, 0, 0, "はぁ！？\nどこ聞いたらそうなるのよ！\nあたしは別に楽しみになんか…！");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (1, 2, "", 5, 0, 142, "カリン", 190801, 80003, 0, 0, "キャルさんの心からの想い\nみなさんにも伝わったでしょうか？\n私も2.5周年が楽しみです！\n以上、カリンがお伝えしました！");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (0, 2, "", 11, 0, 143, "キャル", 106001, 80003, 0, 0, "心からの想いって何なのよ！？\n勝手に人の言葉を\n捻じ曲げんじゃないわよ！\nこのくそ眼鏡ーーーっ！");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (0, 3, "", 6, 0, 144, "コッコロ", 105901, 80003, 0, 0, "ペコリーヌさま、もうすぐ\n記念日でございますね\nこういった節目というのは\n感慨深いものでございます");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (1, 3, "", 5, 0, 145, "ペコリーヌ", 105801, 80003, 0, 0, "色んな思い出が蘇ってきますね！\n楽しい出来事が\nいっぱいありました♪");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (0, 3, "", 7, 0, 146, "コッコロ", 105901, 80003, 0, 0, "はい、そうでございますね\n主さまも【美食殿】の活動の他にも\nいろんなご経験をされたと\n聞いておりますよ");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (0, 3, "", 8, 0, 147, "コッコロ", 105901, 80003, 0, 0, "たしか…ランドソルで話題沸騰と\nなっていた、魔法少女なるものに\nお会いになられたとか");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (1, 3, "", 6, 0, 148, "ペコリーヌ", 105801, 80003, 0, 0, "魔法少女って、あの美味しくって\n栄養たっぷりの大ヒット商品\n『魔法少女ソーセージ』の箱に\n描いてある女の子のことですか！？");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (1, 3, "", 7, 0, 149, "ペコリーヌ", 105801, 80003, 0, 0, "あのソーセージ\n美味しいんですよね～♪\nわたしもたっくさん食べてますよ！");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (0, 3, "", 9, 0, 150, "コッコロ", 105901, 80003, 0, 0, "あとは、牧場に素敵な温泉が\n出来たとか…");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (1, 3, "", 8, 0, 151, "ペコリーヌ", 105801, 80003, 0, 0, "牧場ですか！？　温泉につかって\nチーズもオツですね～♪　考えた\nだけでよだれが出ちゃいそうです！\nやばいですね☆");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (0, 3, "", 10, 0, 152, "コッコロ", 105901, 80003, 0, 0, "ペコリーヌさま\n言ってるそばからよだれが…\n今お拭きしますね。ふき、ふき");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (1, 3, "", 9, 0, 153, "ペコリーヌ", 105801, 80003, 0, 0, "えへへ、ありがとうございます\nコッコロちゃん！");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (0, 3, "", 11, 0, 154, "コッコロ", 105901, 80003, 0, 0, "それにしても、主さまは\n【美食殿】の一員として様々な\n美食と出会われていたのですね\nわたくし、感服いたしました");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (1, 3, "", 10, 0, 155, "ペコリーヌ", 105801, 80003, 0, 0, "これからもたくさん冒険をして\nめいっぱい美食を\n味わい尽くしましょうね！");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (0, 4, "", 11, 0, 156, "ペコリーヌ", 105801, 80003, 0, 0, "2.5周年カウントダウン♪\nキャルちゃんキャルちゃん！\nわくわくしますね☆");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (1, 4, "", 12, 0, 157, "キャル", 106001, 80003, 0, 0, "あぁもう、うるさいわね～\nまだまだ先でしょ？\nちょっとは落ち着きなさいよ");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (0, 4, "", 12, 0, 158, "ペコリーヌ", 105801, 80003, 0, 0, "キャルちゃんだって最近\nソワソワしてるじゃないですか～\nさっきもご機嫌そうに鼻歌とか\n歌ってましたよね？");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (1, 4, "", 13, 0, 159, "キャル", 106001, 80003, 0, 0, "なっ…！　き、聞いてたの！？\nじゃない、歌ってないわよ！？\nあんたいい加減なこと言うと\nぶっ殺すわよ！？");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (0, 4, "", 13, 0, 160, "ペコリーヌ", 105801, 80003, 0, 0, "えっへへ～♪\nわたしは最近のキャルちゃんが\nもっともっと大好きですよ♪\nすごく積極的になりましたよね！");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (1, 4, "", 14, 0, 161, "キャル", 106001, 80003, 0, 0, "…積極的？\nなんの話よ？");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (0, 4, "", 14, 0, 162, "ペコリーヌ", 105801, 80003, 0, 0, "またまた～♪\nアイドルを目指そうとしたこと\n忘れちゃったんですか？");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (0, 4, "", 15, 0, 163, "ペコリーヌ", 105801, 80003, 0, 0, "ムーサの町で\nきゃるきゃる～ん☆　って！");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (1, 4, "", 15, 0, 164, "キャル", 106001, 80003, 0, 0, "あっ…！？　ちちち違うわよっ！\nあれは操られてただけで\nあたしはアイドルなんか\n目指してないっての！！");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (0, 4, "", 16, 0, 165, "ペコリーヌ", 105801, 80003, 0, 0, "本当に本当ですか？\nわたし、キャルちゃんとっても\n乗り気だなって\n思ってたんですけど～");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (1, 4, "", 16, 0, 166, "キャル", 106001, 80003, 0, 0, "まぁ、悪くはなかったけど…って\nだ、だから目指してないって\n言ってるでしょ！！\nなんてこと思い出させんのよ！？");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (1, 4, "", 17, 0, 167, "キャル", 106001, 80003, 0, 0, "ああ…ダメだわ…\nもう殺すしかない…\n2.5周年が来る前に\n記憶ごと消し去ってやるー！");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (0, 5, "", 18, 0, 168, "キャル", 106001, 80003, 0, 0, "2.5周年まであと10日…\nふ～ん？\n案外早いもんね？");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (1, 5, "", 12, 0, 169, "コッコロ", 105901, 80003, 0, 0, "そうでございますね…\nその日のためにやるべきことは\nまだまだございます\n気を引き締めねばなりません…！");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (0, 5, "", 19, 0, 170, "キャル", 106001, 80003, 0, 0, "やる気十分ねコロ助…\nそんな気負ってるとしんどいわよ？\nお気楽にやりましょ？");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (1, 5, "", 13, 0, 171, "コッコロ", 105901, 80003, 0, 0, "キャルさま…\nありがとうございます\nキャルさまは本当に\n優しいおかたです");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (0, 5, "", 20, 0, 172, "キャル", 106001, 80003, 0, 0, "な、なにわけの分かんないこと\n言ってんのよ…\nあたしは優しくなんかないっての");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (1, 5, "", 14, 0, 173, "コッコロ", 105901, 80003, 0, 0, "そんなことはございません\n…あの、実はわたくし\nキャルさまに\nひとつお願いがございまして");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (0, 5, "", 21, 0, 174, "キャル", 106001, 80003, 0, 0, "お願い？　珍しいわね\nコロ助がそんなこと言うなんて\n…まあ、あたしに出来ることなら\n別にいいけど");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (1, 5, "", 15, 0, 175, "コッコロ", 105901, 80003, 0, 0, "ありがとうございます\n実は記念日へ向けて\n『かくし芸』というものを\n用意してみようかと思いまして");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (0, 5, "", 22, 0, 176, "キャル", 106001, 80003, 0, 0, "かくし芸？");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (1, 5, "", 16, 0, 177, "コッコロ", 105901, 80003, 0, 0, "はい。きゃるきゃる～ん☆　を\n参考に、ころころ～ん☆　という\nご挨拶を考えてみたのですが\nポーズがうまくいかなくて…");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (0, 5, "", 23, 0, 178, "キャル", 106001, 80003, 0, 0, "～～！！　ちょっと褒められて\nいい気になって損したわ！！\nふざけんなふざけんな\nふ～ざ～け～ん～な～っ！！");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (0, 6, "", 17, 0, 179, "ペコリーヌ", 105801, 80003, 0, 0, "あと９日！　もうすぐですよ♪\nえへへ、楽しみで楽しみで\nごはんが進みますね☆");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (2, 6, "", 24, 0, 180, "キャル", 106001, 80003, 0, 0, "ごはんが進みますね☆\nじゃなーい！\nいくらなんでも食べ過ぎよ！\n記念日、迎えられなくなるわよ！？");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (1, 6, "", 17, 0, 181, "コッコロ", 105901, 80003, 0, 0, "大丈夫ですよキャルさま\n食事はわたくしたちの\n歩んできた道そのもの\nなのですから");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (0, 6, "", 18, 0, 182, "ペコリーヌ", 105801, 80003, 0, 0, "さっすがコッコロちゃん\nいいことを言いますね！\nそう、わたしたち\n【美食殿】の活動目的は─");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (2, 6, "", 25, 0, 183, "キャル", 106001, 80003, 0, 0, "─みんなで楽しく食事をすること\nでしょ？\nあれだけ食べ歩いてきたんだから\n分かってるわよ");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (1, 6, "", 18, 0, 184, "コッコロ", 105901, 80003, 0, 0, "はい…そうでございますね♪\nそれにしてもわたくしたち\n本当にいろいろなものを\n食べ歩いてきましたね…");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (2, 6, "", 26, 0, 185, "キャル", 106001, 80003, 0, 0, "そうね…ほんっとうにね…\n毒まみれのニセドラゴンとか\n恐竜…は逃げられちゃったっけ\nあとワニゴ…ワニの魔物とかね");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (2, 6, "", 27, 0, 186, "キャル", 106001, 80003, 0, 0, "そして、とうとう本物の\nドラゴンまで相手に\nしちゃったのよね、あたしたちって");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (2, 6, "", 28, 0, 187, "キャル", 106001, 80003, 0, 0, "信じられない強さだったわね\nあのドラゴン…やっぱり\n作戦はしっかり立てていかないと\nダメよね");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (0, 6, "", 19, 0, 188, "ペコリーヌ", 105801, 80003, 0, 0, "えへへ…☆\nキャルちゃんが色んなことを\n覚えていてくれて\nうれしいです♪");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (1, 6, "", 19, 0, 189, "コッコロ", 105901, 80003, 0, 0, "わたくしも鮮明に覚えておりますよ\n主さまもきっと…♪");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (2, 6, "", 29, 0, 190, "キャル", 106001, 80003, 0, 0, "あったり前でしょ！\n忘れないわよ、あんな滅茶苦茶な\nものばかり食べさせられて！\n…忘れられるわけ、ないじゃない");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (0, 7, "", 30, 0, 191, "キャル", 106001, 80003, 0, 0, "ねえちょっと、ちょっと待って！？\nカリンから、2.5周年記念の\n生放送に出演してほしいって\n言われたんだけど！");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (0, 7, "", 31, 0, 192, "キャル", 106001, 80003, 0, 0, "なんでそういう大事なことを\n急に言うわけ！？\nそんなの聞いてないわよ～！？");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (0, 7, "", 32, 0, 193, "キャル", 106001, 80003, 0, 0, "いっぱい人に見られちゃうのよね？\nなんであたしがそんなこと…");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (0, 7, "", 33, 0, 194, "キャル", 106001, 80003, 0, 0, "あー\nあー\n…声、これで大丈夫かしら？");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (0, 7, "", 34, 0, 195, "キャル", 106001, 80003, 0, 0, "聞き取りにくいかもしれないわね…\nもうちょっと明るい方がいいかも\nえっと…こんな感じ？");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (0, 7, "", 35, 0, 196, "キャル", 106001, 80003, 0, 0, "オイッスー☆");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (0, 7, "", 36, 0, 197, "キャル", 106001, 80003, 0, 0, "……\nいや、ないわ\nいつもどおりが一番ね、うん");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (0, 7, "", 37, 0, 198, "キャル", 106001, 80003, 0, 0, "もう、記念の生放送なんて\n超責任重大なやつじゃない…\nもしなにか失敗とかしたら…");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (0, 7, "", 38, 0, 199, "キャル", 106001, 80003, 0, 0, "ど、どど、どうしよう！？\n緊張してきちゃった…！！");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (0, 8, "", 20, 0, 200, "コッコロ", 105901, 80003, 0, 0, "主さま、わたくし\nペコリーヌさまとキャルさまと共に\n2.5周年を祝う生放送に\n出演する大役を仰せつかりました");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (0, 8, "", 21, 0, 201, "コッコロ", 105901, 80003, 0, 0, "多くの方々に\n『プリンセスコネクト！\nRe:Dive』の魅力をお伝えする\n重要な役割でございます");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (0, 8, "", 22, 0, 202, "コッコロ", 105901, 80003, 0, 0, "わたくし、全身全霊をもって\n生放送に取り組みたいと\n思っております");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (0, 8, "", 23, 0, 203, "コッコロ", 105901, 80003, 0, 0, "ですが、もしかしたら\nセリフを噛んでしまったり\n段取りを間違えてしまったり\nするかもしれません…");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (0, 8, "", 24, 0, 204, "コッコロ", 105901, 80003, 0, 0, "そのようなことがないよう\n練習はしっかりしておかなくては\nまずはこちらから…");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (0, 8, "", 25, 0, 205, "コッコロ", 105901, 80003, 0, 0, "オイッスー☆");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (0, 8, "", 26, 0, 206, "コッコロ", 105901, 80003, 0, 0, "先ほどキャルさまが練習されて\nいるのをお見かけしたので\nわたくしもと思いまして…\nいかがでしょうか？");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (0, 8, "", 27, 0, 207, "コッコロ", 105901, 80003, 0, 0, "良い感じ、ですか？\n…ふふ、ありがとうございます\n主さまのあたたかいお言葉があれば\nわたくしは百人力でございます");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (0, 8, "", 28, 0, 208, "コッコロ", 105901, 80003, 0, 0, "この大役を無事に成し遂げ\n主さまに素敵な2.5周年を\n迎えていただけるよう…\nわたくし、尽力いたしますね");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (0, 9, "", 20, 0, 209, "ペコリーヌ", 105801, 80003, 0, 0, "オイッスー☆");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (0, 9, "", 21, 0, 210, "ペコリーヌ", 105801, 80003, 0, 0, "…う～ん、今のはちょっと\n違う感じがしますね\n堅苦しかったかもしれません");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (0, 9, "", 22, 0, 211, "ペコリーヌ", 105801, 80003, 0, 0, "あと６日で2.5周年ですか…");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (0, 9, "", 23, 0, 212, "ペコリーヌ", 105801, 80003, 0, 0, "この年月がオイッスーの\n歴史なんだと思うと\nじ～んとしちゃいます！\nやばいですね☆");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (0, 9, "", 24, 0, 213, "ペコリーヌ", 105801, 80003, 0, 0, "生放送で最高のオイッスー☆　を\nみなさんにお届けするために\n頑張らないと！\nそれじゃあもう一度…");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (0, 9, "", 25, 0, 214, "ペコリーヌ", 105801, 80003, 0, 0, "オイッスー☆");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (0, 9, "", 26, 0, 215, "ペコリーヌ", 105801, 80003, 0, 0, "…うう～ん、どうしてでしょう\nまだ何かが違う気がします…\nもしかしたら\nおなかが空きすぎてるとか？");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (0, 9, "", 27, 0, 216, "ペコリーヌ", 105801, 80003, 0, 0, "今さっき食べたばっかりですけど\nおなかが減っては\n良いオイッスー☆　は\n出せませんよね！");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (0, 9, "", 28, 0, 217, "ペコリーヌ", 105801, 80003, 0, 0, "そうと決まれば、コッコロちゃんと\nキャルちゃんを誘って\nごはんにしましょう！\n善は急げです！");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (0, 9, "", 29, 0, 218, "ペコリーヌ", 105801, 80003, 0, 0, "あ、二人が丁度いいところに！\nオイッス～☆　…ああ！！\n今の、今のですよ～♪");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (0, 9, "", 30, 0, 219, "ペコリーヌ", 105801, 80003, 0, 0, "なるほど、どんな時も\n自然体が一番ってことですね！\nこの調子で、生放送も\n頑張っちゃいます♪");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (0, 10, "", 31, 0, 220, "ペコリーヌ", 105801, 80003, 0, 0, "2.5周年まで残り５日ですが\nその前にもうすぐ生放送ですよ！\nコッコロちゃん\n準備の方はどうですか？");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (1, 10, "", 29, 0, 221, "コッコロ", 105901, 80003, 0, 0, "はい。わたくし、しっかりと\n備えてまいりました\n万事抜かりはございません");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (0, 10, "", 32, 0, 222, "ペコリーヌ", 105801, 80003, 0, 0, "おお～すごい自信を感じます…！\nいい生放送になりそうですね☆\n……あれ？　なんだかこの辺り\n揺れていませんか？");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (2, 10, "", 39, 0, 223, "キャル", 106001, 80003, 0, 0, "…………");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (1, 10, "", 30, 0, 224, "コッコロ", 105901, 80003, 0, 0, "キャルさま？\nお風邪をひかれたんでしょうか\nひどい震えですが…");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (2, 10, "", 40, 0, 225, "キャル", 106001, 80003, 0, 0, "かかかか風邪じゃないわよ！\nここここれはただ\nななな生放送が楽しみ過ぎて\nワワワワクワクが止まらないだけ！");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (0, 10, "", 33, 0, 226, "ペコリーヌ", 105801, 80003, 0, 0, "大丈夫ですかキャルちゃん！？\nそうだ、これを飲んでください！");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (2, 10, "", 41, 0, 227, "キャル", 106001, 80003, 0, 0, "きき気がきくじゃない、ありがとっ\nごくっ、んく…ぶはぁっ！？\nちょっと何飲ませたの！？\n辛っ！　苦ぁ！？　甘ぁっ！？");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (0, 10, "", 34, 0, 228, "ペコリーヌ", 105801, 80003, 0, 0, "これは魔物のエキスに薬草に\nその他色んなものを混ぜた\n特製の栄養ドリンクです！");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (0, 10, "", 35, 0, 229, "ペコリーヌ", 105801, 80003, 0, 0, "これを飲めば体ぽかぽかで\n元気いっぱいですよ♪");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (2, 10, "", 42, 0, 230, "キャル", 106001, 80003, 0, 0, "このアホリーヌ！\n風邪じゃないって言ったでしょ！？\nどさくさに紛れて\nそんな恐ろしいもん飲ませんな～！");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (1, 10, "", 31, 0, 231, "コッコロ", 105901, 80003, 0, 0, "キャルさま\n震えが収まっておりますね\nよかったです…\nわたくし、心配いたしました");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (2, 10, "", 43, 0, 232, "キャル", 106001, 80003, 0, 0, "え？　ああ、ホントね…って\nだから風邪じゃないって\n言ってるのに…\nまあいいわこの際なんでも");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (0, 10, "", 36, 0, 233, "ペコリーヌ", 105801, 80003, 0, 0, "えっへへ～♪　いつも通りの\nキャルちゃんに戻りましたし\n素敵な生放送が出来そうですね！\n今から楽しみです☆");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (0, 11, "", 6, 0, 234, "カリン", 190801, 80003, 0, 0, "ランドソルのみなさま、こんにちは\n生放送の会場設営を担当しています\n【ギルド管理協会】のカリンです");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (0, 11, "", 7, 0, 235, "カリン", 190801, 80003, 0, 0, "【美食殿】のみなさんは\nまもなく始まる生放送に向けて\n最後の調整のため\n席を外しています");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (0, 11, "", 8, 0, 236, "カリン", 190801, 80003, 0, 0, "頑張っている３人の\n邪魔をするわけには\nいきませんので、ご容赦ください");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (0, 11, "", 9, 0, 237, "カリン", 190801, 80003, 0, 0, "ですので、本日は私から\n【美食殿】のみなさんの様子を\nお伝えさせていただこうと思います");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (0, 11, "", 10, 0, 238, "カリン", 190801, 80003, 0, 0, "まずはペコリーヌさんですが…\n何やら大量のおにぎりを\n食べているようです\nえっと…栄養は大事ですよね");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (0, 11, "", 11, 0, 239, "カリン", 190801, 80003, 0, 0, "次にコッコロさんですが\nこちらは発声練習をしています");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (0, 11, "", 12, 0, 240, "カリン", 190801, 80003, 0, 0, "一生懸命、小さなお口を開けて\n声を出す姿が応援したくなりますね");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (0, 11, "", 13, 0, 241, "カリン", 190801, 80003, 0, 0, "そしてキャルさんは…\nこれは…堂々としたものですね\n何もせず、ただ立ち尽くして…");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (0, 11, "", 14, 0, 242, "カリン", 190801, 80003, 0, 0, "あれ？\nもしかして緊張で気を失って…？");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (0, 11, "", 15, 0, 243, "カリン", 190801, 80003, 0, 0, "…ええと\n【美食殿】のみなさんは\nやる気十分なようですね！");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (0, 11, "", 16, 0, 244, "カリン", 190801, 80003, 0, 0, "３人とも生放送を\nいいものにしようと\n全力で頑張ってくれていますので\nどうかご期待ください");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (0, 11, "", 17, 0, 245, "カリン", 190801, 80003, 0, 0, "それでは\nまた明日お会いしましょう♪");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (0, 12, "", 44, 0, 246, "キャル", 106001, 80003, 0, 0, "2.5周年まであと３日！\nそして生放送は明日！\nなんかいよいよって感じね…");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (2, 12, "", 37, 0, 247, "ペコリーヌ", 105801, 80003, 0, 0, "３人でい～っぱい練習しましたし\nきっと大丈夫ですよ☆");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (1, 12, "", 32, 0, 248, "コッコロ", 105901, 80003, 0, 0, "ペコリーヌさまに\n大丈夫と言ってもらえると\nとても心強いですね");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (0, 12, "", 45, 0, 249, "キャル", 106001, 80003, 0, 0, "信じすぎちゃだめよコロ助\nこいつはなーんにも\n考えてないだけなんだから");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (2, 12, "", 38, 0, 250, "ペコリーヌ", 105801, 80003, 0, 0, "ひどいですよぉキャルちゃ～ん！");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (1, 12, "", 33, 0, 251, "コッコロ", 105901, 80003, 0, 0, "ふふ。お二人とも\n普段通りの様子で\n安心いたしました");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (2, 12, "", 39, 0, 252, "ペコリーヌ", 105801, 80003, 0, 0, "はいっ☆\n生放送でもなんでも\n全力全開、わたしらしく\nぶつかっていくだけです！");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (0, 12, "", 46, 0, 253, "キャル", 106001, 80003, 0, 0, "そうね。おめでたいことなんだし\nここまで来たんなら\n楽しめるだけ\n楽しむしかないわよね！");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (1, 12, "", 34, 0, 254, "コッコロ", 105901, 80003, 0, 0, "わたくしも、普段よりも心が\n熱くなっております\nこの胸の気持ちをお伝えできるよう\n精一杯努力いたします…！");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (2, 12, "", 40, 0, 255, "ペコリーヌ", 105801, 80003, 0, 0, "それでは、いきましょう！\n明日の生放送、絶対に\n成功させましょうね☆");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (0, 13, "", 41, 0, 256, "ペコリーヌ", 105801, 80003, 0, 0, "えっと、最初のひと言は…あれ？\nキャルちゃん、わたし\n何て言うんでしたっけ？");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (2, 13, "", 47, 0, 257, "キャル", 106001, 80003, 0, 0, "は！？\nなにいきなりど忘れしてるの！？\nっていうかあんた、台本は！？");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (0, 13, "", 42, 0, 258, "ペコリーヌ", 105801, 80003, 0, 0, "忘れてきちゃいました☆");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (2, 13, "", 48, 0, 259, "キャル", 106001, 80003, 0, 0, "忘れてきちゃいました☆\nで済ませられると思ってんの！？\nほら、あたし二冊持ってきたから\nこれ使いなさい！");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (1, 13, "", 35, 0, 260, "コッコロ", 105901, 80003, 0, 0, "マイクとは、こんな高い位置に\nあるものなのですね…！\n背伸びをすれば、何とか…\nう～ん、うぅ～ん…！");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (2, 13, "", 49, 0, 261, "キャル", 106001, 80003, 0, 0, "あぁもう\n少し下げればいいでしょ！？\nこれくらいでいい？\nまったく、世話が焼けるわね…");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (0, 13, "", 43, 0, 262, "ペコリーヌ", 105801, 80003, 0, 0, "あれ？\nキャルちゃん、後ろ髪が\nはねちゃってますよ？");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (2, 13, "", 50, 0, 263, "キャル", 106001, 80003, 0, 0, "え？　うそっ！？\nちゃんと確かめてきたのに！\nどこどこ！？");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (1, 13, "", 36, 0, 264, "コッコロ", 105901, 80003, 0, 0, "キャルさま、動かないで\nくださいまし。今くしで…\nはい、直りましたよ");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (2, 13, "", 51, 0, 265, "キャル", 106001, 80003, 0, 0, "あ、ありがと…はぁ。生放送\n本番までもうすぐなのに\nこんなことしてる場合じゃ\nないわよね");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (1, 13, "", 37, 0, 266, "コッコロ", 105901, 80003, 0, 0, "はい、時間は残りわずかです\nですが、慌ただしく\n動き回るこの時間も\nなんだか楽しくて…♪");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (2, 13, "", 52, 0, 267, "キャル", 106001, 80003, 0, 0, "コロ助、あんた…って\nそうじゃなくて！\n胸にジンワリきてる\n暇なんかないでしょ…！？");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (0, 13, "", 44, 0, 268, "ペコリーヌ", 105801, 80003, 0, 0, "あはは♪\nキャルちゃんの動きが\nとっても面白いです♪\nやばいですね☆");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (1, 13, "", 38, 0, 269, "コッコロ", 105901, 80003, 0, 0, "ふふ\nきっと面白い生放送になると\nわたくし、確信しております");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (0, 13, "", 45, 0, 270, "ペコリーヌ", 105801, 80003, 0, 0, "絶対絶対、間違いありません！\n見てくれるみなさんが\n笑顔になれる時間を\nお届けしましょう！");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (2, 13, "", 53, 0, 271, "キャル", 106001, 80003, 0, 0, "そんなの当然でしょ！\n誰が見たって面白いって\n言ってもらえるように\nあれだけ準備したんだから！");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (0, 13, "", 46, 0, 272, "ペコリーヌ", 105801, 80003, 0, 0, "それでは\n記念日直前生放送！\n楽しみにしててくださいね☆");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (0, 14, "", 18, 0, 273, "カリン", 190801, 80003, 0, 0, "こんにちは\n【ギルド管理協会】のカリンです");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (0, 14, "", 19, 0, 274, "カリン", 190801, 80003, 0, 0, "昨日の生放送は\nいかがだったでしょうか？");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (0, 14, "", 20, 0, 275, "カリン", 190801, 80003, 0, 0, "たくさんの笑顔と喜びと\nそして驚きを受け取って\nいただけたのではないかと思います");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (0, 14, "", 21, 0, 276, "カリン", 190801, 80003, 0, 0, "そしていよいよ\n明日は2.5周年の当日\n待ちに待った記念日を\n迎えることとなります");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (0, 14, "", 22, 0, 277, "カリン", 190801, 80003, 0, 0, "【美食殿】のみなさんも\n張り切って様々な準備を\nされていますよ");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (0, 14, "", 23, 0, 278, "カリン", 190801, 80003, 0, 0, "【ギルド管理協会】も\n万全のサポート体制で\n協力してまいりたいと思います");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (0, 14, "", 24, 0, 279, "カリン", 190801, 80003, 0, 0, "…ふふ、本当に楽しみですね\n【ギルド管理協会】の職員として\nだけではなく、私個人としても…");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (0, 14, "", 25, 0, 280, "カリン", 190801, 80003, 0, 0, "この記念日を迎えられることが\n心から楽しみですし\n幸せを感じています");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (0, 14, "", 26, 0, 281, "カリン", 190801, 80003, 0, 0, "きっと【美食殿】のみなさんは\nそれ以上に心を弾ませて\nいることでしょう");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (0, 14, "", 27, 0, 282, "カリン", 190801, 80003, 0, 0, "それでは\n明日からの2.5周年を\nどうぞ、お楽しみに…♪");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (0, 15, "", 47, 0, 283, "ペコリーヌ", 105801, 80003, 0, 0, "準備はいいですかっ？\n…いっきますよー！");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (2, 15, "", 54, 0, 284, "キャル", 106001, 80003, 0, 0, "祝！");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (1, 15, "", 39, 0, 285, "コッコロ", 105901, 80003, 0, 0, "2.5周年！");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (0, 15, "", 48, 0, 286, "ペコリーヌ", 105801, 80003, 0, 0, "おめでとうございま～す☆");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (2, 15, "", 55, 0, 287, "キャル", 106001, 80003, 0, 0, "少し前まではまだまだ先じゃない\nとか言ってたけど\n本当にあっという間だったわね");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (1, 15, "", 40, 0, 288, "コッコロ", 105901, 80003, 0, 0, "光陰矢の如し…\nとはこのことでございますね\nでも、今日という日を無事に\n迎えることができて良かったです");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (0, 15, "", 49, 0, 289, "ペコリーヌ", 105801, 80003, 0, 0, "コッコロちゃん！　キャルちゃん！\n落ち着くには\nまだ早いですよ！\n盛り上がるのはこれからです☆");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (2, 15, "", 56, 0, 290, "キャル", 106001, 80003, 0, 0, "ほんとあんたはいつも\n全力全開ねー\nでもそうね、記念日なんだし\nパーっといきましょ！");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (1, 15, "", 41, 0, 291, "コッコロ", 105901, 80003, 0, 0, "ええ、わたくしも全力全開で\nまいります…！\n主さま、さあ\nどうぞ手を取ってくださいまし…♪");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (2, 15, "", 57, 0, 292, "キャル", 106001, 80003, 0, 0, "あんたもコロ助も、浮かれて\n転ぶんじゃないわよ？\n…仕方ないから、あたしも\n手を繋いであげるわよ");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (0, 15, "", 50, 0, 293, "ペコリーヌ", 105801, 80003, 0, 0, "あー！　二人ともずるいです！\nわたしもっ、ギュー♪");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (2, 15, "", 58, 0, 294, "キャル", 106001, 80003, 0, 0, "ちょっ、ペコリーヌ！\nくっつき過ぎよ！");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (0, 15, "", 51, 0, 295, "ペコリーヌ", 105801, 80003, 0, 0, "記念日だから\n平気平気♪\nやばいですね☆");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (2, 15, "", 59, 0, 296, "キャル", 106001, 80003, 0, 0, "意味分かんないわよ！");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (1, 15, "", 42, 0, 297, "コッコロ", 105901, 80003, 0, 0, "ふふ。このめでたき日に\n喜びがあふれておりますね\n主さまは…いかがでしょうか？");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (1, 15, "", 43, 0, 298, "コッコロ", 105901, 80003, 0, 0, "喜んでいただけているならば\nわたくしはとてもとても\n幸せでございます");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (0, 15, "", 52, 0, 299, "ペコリーヌ", 105801, 80003, 0, 0, "さぁ、2.5周年を\n楽しみ尽くしますよ☆\nまだまだ食べたいものもありますし\nやりたいこともたくさんです！");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (2, 15, "", 60, 0, 300, "キャル", 106001, 80003, 0, 0, "分かった、分かったから\n引っ張るんじゃないわよ！\n…そんな掴まなくても\nちゃんとついていくから");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (1, 15, "", 44, 0, 301, "コッコロ", 105901, 80003, 0, 0, "ペコリーヌさま…キャルさま…\n主さま…共にまいりましょう\nどこまでも…！");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (0, 15, "", 53, 0, 302, "ペコリーヌ", 105801, 80003, 0, 0, "はい！　それでは2.5周年\n食べつくしツアーへ！\nそして、その先の未来へ\n向かって出発しましょう！");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (0, 15, "105901,45,106001,61", 54, 0, 303, "ペコリーヌ・コッコロ・キャル", 105801, 80003, 0, 1, "2.5周年\nありがとうございます！");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (1, 0, "", 1, 1, 304, "カリン", 190804, 60002, 0, 0, "新年を迎え、新たに始まる一日を\nおみくじで占ってみませんか？\n良い運勢であるほど、\n沢山のプレゼントが貰えますよ♪");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (2, 0, "", 0, 1, 305, "", 0, 60002, 1, 0, "今日の運勢は姫吉！　どんな不可能も可能にできちゃう！　　　　仲間と食卓を囲めばさらに運気上昇よ！　ただし魔物料理以外！");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (2, 0, "", 0, 1, 306, "", 0, 60002, 1, 0, "今日の運勢は姫吉！　やること全てが最高潮！　やばいですね☆　ラッキーアイテムはおにぎり！　お腹一杯で幸せが続くでしょう！");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (2, 0, "", 0, 1, 307, "", 0, 60002, 1, 0, "今日の運勢は姫吉！　最強の運勢でどんなドジも跳ね除けます！　大切な人と一緒に、最高の一日になること間違いなし！");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (2, 0, "", 0, 1, 308, "", 0, 60002, 1, 0, "今日の運勢は姫吉！　どんな挑戦も上手くいく、最高の運勢です！理想の自分に変身できる絶好の機会！　新しい一歩を踏み出そう！");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (2, 0, "", 0, 2, 309, "", 0, 60002, 1, 0, "今日の運勢は姫吉！　やること全てが上手くいく最高の一日！　　あなたの活躍に先生もにっこりです。いい子いい子♪");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (2, 0, "", 0, 1, 310, "", 0, 60002, 2, 0, "今日の運勢は大吉！　お裁縫好きな女の子のお墨付きです！　　　お世話したがりの妹にめいっぱい愛されちゃうかも！？");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (2, 0, "", 0, 1, 311, "", 0, 60002, 2, 0, "今日の運勢は大吉！　ラッキーカラーは赤！　　　　　　　　　　湧き上がるアイデアの数々に、高笑いが止まりませんわ！");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (2, 0, "", 0, 1, 312, "", 0, 60002, 2, 0, "今日の運勢は大吉！　ラッキーワードは「ちぇる～ん♪」　　　　出会う人みんなに言ってあげると、ハッピーになれますよ！");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (2, 0, "", 0, 1, 313, "", 0, 60002, 2, 0, "今日の運勢は大吉！　運勢はバッチリで無敵状態！　　　　　　　龍眼で全てを見通して、思い通りの一日を過ごしましょう！");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (2, 0, "", 0, 2, 314, "", 0, 60002, 2, 0, "今日の運勢は大吉！　悩んでいたことが解決しそうです！　　　　たまには勉強も仕事も忘れて、心あたたまる家族と過ごしましょ！");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (2, 0, "", 0, 1, 315, "", 0, 60002, 3, 0, "今日の運勢は中吉！　家の中でゆっくり過ごすのがよさそう！　　ラッキーアイテムはゲームよ！　ベストスコアを更新できるかも？");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (2, 0, "", 0, 1, 316, "", 0, 60002, 3, 0, "今日の運勢は中吉！　上手くなりたいことに積極的に挑戦してみてサックス好きの妹が、手取り足取りサポートしてくれるかも～？");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (2, 0, "", 0, 1, 317, "", 0, 60002, 3, 0, "今日の運勢は中吉！　仕事運が急上昇中です！　　　　　　　　　きっと「煉獄に舞う一陣の疾風」の如き活躍ができますよ！");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (2, 0, "", 0, 1, 318, "", 0, 60002, 3, 0, "今日の運勢は中吉！　日頃の努力が報われます！　　　　　　　　親しい友人がいるなら報告してみて。一緒に喜んでくれるはずだ。");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (2, 0, "", 0, 1, 319, "", 0, 60002, 3, 0, "今日の運勢は中吉！　商売運が上がってきています！　　　　　　ラッキーアイテムはたい焼き！　和菓子パワーで売上アップです！");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (2, 0, "", 0, 1, 320, "", 0, 60002, 3, 0, "今日の運勢は中吉！　チャンスを待つと良い結果に！　　　　　　ラッキーアイテムのプリンを食べて、運を呼び込みましょう！");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (2, 0, "", 0, 2, 321, "", 0, 60002, 3, 0, "今日の運勢は中吉！　運気が着々と上昇中！　　　　　　　　　　精霊の加護を受けたかのごとく、色々な事がうまくいきますよ♪");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (2, 0, "", 0, 1, 322, "", 0, 60002, 4, 0, "今日の運勢は小吉！　まだ見ぬ危険が隠れているかも！　　　　　でも安心しろ！　提督が貴公を守ってくれるはずだぞ！");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (2, 0, "", 0, 1, 323, "", 0, 60002, 4, 0, "今日の運勢は小吉！　いろんな事件が起こる一日になりそう！　　状況をよく観察してみようじゃないか！　まさに探偵のごとくね！");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (2, 0, "", 0, 1, 324, "", 0, 60002, 4, 0, "今日の運勢は小吉！　気の向くままに過ごすのが幸せへの近道！　美味い魚を食べて猫を眺めて、自然体で過ごすのはどうだい？");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (2, 0, "", 0, 1, 325, "", 0, 60002, 4, 0, "今日の運勢は小吉！　運気は高いけども、ハプニングには注意！　出かけた先で、「ふしんしゃ」扱いされてしまうかも……");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (2, 0, "", 0, 1, 326, "", 0, 60002, 4, 0, "今日の運勢は小吉！　同腹一心の友だちが見つかるかも！　　　　キーワードは「ユニちゃんズ」、記憶に刻みましょう！");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (2, 0, "", 0, 1, 327, "", 0, 60002, 4, 0, "今日の運勢は小吉！　周りに流されず、マイペースな一日を！　　ただし寝すぎには注意ぐうたらし過ぎず適度な運動を、だってさ～");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (2, 0, "", 0, 2, 328, "", 0, 60002, 4, 0, "今日の運勢は小吉！　根を詰めずにリラックスすると運気向上！　ラッキーパーソンはアイドル。歌があなたを幸せにしてくれます♪");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (3, 0, "", 2, 0, 329, "カリン", 190804, 60002, 0, 0, "おみくじの結果はどうでしたか？\n新たに始まる一日が、あなたに\nとって良い日になりますように\nまた明日も遊びに来て下さいね♪");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (3, 7, "", 3, 0, 330, "カリン", 190804, 60002, 0, 0, "おみくじは楽しんで頂けましたか？\nあなたの新たなる年が\n素晴らしいものになるよう、\n心からお祈りいたします");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (4, 1, "", 1, 0, 331, "コッコロ", 105901, 80005, 0, 0, "ささ、シェフィさまはこちらへ…");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (0, 1, "", 1, 0, 332, "シェフィ", 106401, 80005, 0, 0, "コッコロさん、どこへ行くの…？\n…え？");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (3, 1, "", 1, 0, 333, "ペコリーヌ", 105801, 80005, 0, 0, "『おめでとうございます！\nわ～パチパチー！』\n…という感じでどうですかね！？");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (4, 1, "", 2, 0, 334, "コッコロ", 105901, 80005, 0, 0, "ではわたくしも\n後ろからクラッカーを鳴らして\n応戦いたします\nああ、当日が待ち遠しいですね");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (0, 1, "", 2, 0, 335, "シェフィ", 106401, 80005, 0, 0, "ええと…\n二人とも何をしているの？");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (1, 1, "", 1, 0, 336, "キャル", 106001, 80005, 0, 0, "シェフィは初めてだもんね\nあの日が近いからって\n予行練習してんのよ\n気が早いわよね～");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (0, 1, "", 3, 0, 337, "シェフィ", 106401, 80005, 0, 0, "あの日…？");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (3, 1, "", 2, 0, 338, "ペコリーヌ", 105801, 80005, 0, 0, "その通りです…\nいよいよ記念すべきあの日が\n近づいてきましたよ！");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (3, 1, "", 3, 0, 339, "ペコリーヌ", 105801, 80005, 0, 0, "『プリンセスコネクト！\nRe:Dive』3.5周年！");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (2, 1, "", 1, 0, 340, "カリン", 190801, 80005, 0, 0, "やばいですね☆");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (1, 1, "", 2, 0, 341, "キャル", 106001, 80005, 0, 0, "って、なにしれっと\n参加してんのよカリン！");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (2, 1, "", 2, 0, 342, "カリン", 190801, 80005, 0, 0, "ふふ、いいじゃないですか\n【ギルド管理協会】として\n私もみなさんと一緒に\nお祝いをさせてください！");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (2, 1, "", 3, 0, 343, "カリン", 190801, 80005, 0, 0, "それに…記念日が近づけば\nとっておきの情報を\nお届けしますから♪");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (3, 1, "", 4, 0, 344, "ペコリーヌ", 105801, 80005, 0, 0, "というわけで\n今日からシェフィちゃんも一緒に\nカウントダウンしちゃいましょう！\n3.5周年まで…");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (0, 1, "", 4, 0, 345, "シェフィ", 106401, 80005, 0, 0, "えっ！？　ええとええと…！\nあ、あと14日…！");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (3, 2, "", 5, 0, 346, "ペコリーヌ", 105801, 80005, 0, 0, "3.5周年まであと13日\n豪華に、そして盛大に\nお祝いしたいですね☆");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (1, 2, "", 3, 0, 347, "コッコロ", 105901, 80005, 0, 0, "豪華といえば前にとある貴族さまが\n舞踏会を開かれたそうで\n主さまがそのお手伝いを\nしておりました");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (1, 2, "", 4, 0, 348, "コッコロ", 105901, 80005, 0, 0, "そこで美しい所作を学ばれたので\nわたくしも教えていただきました\nしゃなり、しゃなり…\nいかがでしょう？");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (3, 2, "", 6, 0, 349, "ペコリーヌ", 105801, 80005, 0, 0, "すっごく上手ですよ☆\nまるでお姫様みたいです\nせっかくなのでわたしも\nしゃなりしゃなり");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (1, 2, "", 5, 0, 350, "コッコロ", 105901, 80005, 0, 0, "さすがでございます\nペコリーヌさま");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (0, 2, "", 3, 0, 351, "キャル", 106001, 80005, 0, 0, "いや、あんたは\nできなきゃダメでしょ\n本物のお姫様なんだし");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (2, 2, "", 5, 0, 352, "シェフィ", 106401, 80005, 0, 0, "しゃなり、しゃなり…\nふふ、案外できるものね");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (3, 2, "", 7, 0, 353, "ペコリーヌ", 105801, 80005, 0, 0, "わぁ！\nシェフィちゃん\n姿勢がとってもキレイです♪");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (1, 2, "", 6, 0, 354, "コッコロ", 105901, 80005, 0, 0, "さ、次はキャルさまの\n番でございますよ");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (0, 2, "", 4, 0, 355, "キャル", 106001, 80005, 0, 0, "あ、あたしはいいわよ！\nそういうの全然分かんないし…");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (2, 2, "", 6, 0, 356, "シェフィ", 106401, 80005, 0, 0, "大丈夫\nやってみると結構楽しいわよ\nほらほらっ");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (0, 2, "", 5, 0, 357, "キャル", 106001, 80005, 0, 0, "そ、そこまで言うなら…\nしゃなにゅわきゃあっ！");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (0, 2, "", 6, 0, 358, "キャル", 106001, 80005, 0, 0, "いたたた…もぉお～！\nなんであたしがこんな目に～！");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (1, 2, "", 7, 0, 359, "コッコロ", 105901, 80005, 0, 0, "まぁまぁ\n記念日までに練習すれば\nできるようになるかもしれません\nよろしければお教えいたしますよ");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (0, 2, "", 7, 0, 360, "キャル", 106001, 80005, 0, 0, "よし！\nあんたたちができて\nあたしだけできないのはしゃくだし\nやってやろうじゃないの！！");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (1, 3, "", 8, 0, 361, "コッコロ", 105901, 80005, 0, 0, "3.5周年まであと12日\n記念日当日はもちろんですが\nその日を待つ時間というのも\n心躍ります");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (3, 3, "", 8, 0, 362, "ペコリーヌ", 105801, 80005, 0, 0, "分かりますっ！\nどんな特別な料理を食べられるのか\n考えるだけでワクワクしますよね！");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (1, 3, "", 9, 0, 363, "コッコロ", 105901, 80005, 0, 0, "特別な料理といえば、お祭りですね\nそういえば主さまは学生として\n聖学祭に参加されたこと\nがあるとか…");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (2, 3, "", 7, 0, 364, "シェフィ", 106401, 80005, 0, 0, "聖学祭…って、なにかしら？");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (1, 3, "", 10, 0, 365, "コッコロ", 105901, 80005, 0, 0, "聖テレサ女学院の祭典ですよ\n二つのチームが競い合い\n青春を満喫するのが趣旨のようです");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (0, 3, "", 8, 0, 366, "キャル", 106001, 80005, 0, 0, "それってカルミナの\nサプライズライブがあった\nお祭りよね？\nちょっと見たかったかも…");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (0, 3, "", 9, 0, 367, "キャル", 106001, 80005, 0, 0, "カルミナの後の\nライブも好評だったらしいじゃない\n確か、なかよし部\nだったっけ…？");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (3, 3, "", 9, 0, 368, "ペコリーヌ", 105801, 80005, 0, 0, "なかよし部…\n仲が良さそうな名前で\nやばいですね☆");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (0, 3, "", 10, 0, 369, "キャル", 106001, 80005, 0, 0, "いや、そのまんますぎでしょ…");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (2, 3, "", 8, 0, 370, "シェフィ", 106401, 80005, 0, 0, "聖学祭かぁ…なんだか楽しそうね\nそれになかよし部の人たちも\n気になるわ");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (3, 3, "", 10, 0, 371, "ペコリーヌ", 105801, 80005, 0, 0, "それじゃあわたしたちも、\n負けじと仲良くしましょう♪\nほらほらシェフィちゃん、\nぎゅーっ☆　ですよ♪");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (2, 3, "", 9, 0, 372, "シェフィ", 106401, 80005, 0, 0, "えっ？　ええ…\nぎゅーっ…？");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (0, 4, "", 11, 0, 373, "キャル", 106001, 80005, 0, 0, "3.5周年まであと11日！？\nお祝いの準備進んでないんだけど…\nああ～昨日に戻りたいわ…");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (2, 4, "", 10, 0, 374, "シェフィ", 106401, 80005, 0, 0, "そういえばそんな魔道具があるって\n聞いたことがあるわね\n確か、名前はタイムラーベ…");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (0, 4, "", 12, 0, 375, "キャル", 106001, 80005, 0, 0, "なにそれヤバいわね\nでも本当にあるんだったら\n準備よりももっとやり直したいこと\nたくさんあるんだけど…");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (1, 4, "", 11, 0, 376, "コッコロ", 105901, 80005, 0, 0, "もしや正月の件でしょうか…？\nあの時はお金がなくて\n苦労しましたから");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (0, 4, "", 13, 0, 377, "キャル", 106001, 80005, 0, 0, "あれはそうね…\nお金を湯水のように使う\nぺコリーヌを止められたら\nあんな苦労をすることもなかったし");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (3, 4, "", 11, 0, 378, "ペコリーヌ", 105801, 80005, 0, 0, "そんなこともありましたね！\nやり直したいといえば\n『きゃるきゃる～ん♪』\nの方かと思いましたよ！");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (0, 4, "", 14, 0, 379, "キャル", 106001, 80005, 0, 0, "バラすんじゃないわよ\nこのアホリーヌ！\nシェフィはそれ\n知らないんだから！");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (0, 4, "", 15, 0, 380, "キャル", 106001, 80005, 0, 0, "こうなったらもう、なんとか\nタイムラーべを探し出して\n今の会話をなかったことに…\nって、どうしたのよシェフィ");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (2, 4, "", 11, 0, 381, "シェフィ", 106401, 80005, 0, 0, "うん…もし、私だったら…\n私が知らないみんなとの時間を\n見てみたいな、って…");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (3, 4, "", 12, 0, 382, "ペコリーヌ", 105801, 80005, 0, 0, "シェフィちゃん！　タイムなんとか\nなんかなくても大丈夫ですよ！\n一緒の時間はこれから\nどんどん作ればいいんですから！");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (1, 4, "", 12, 0, 383, "コッコロ", 105901, 80005, 0, 0, "はい、今この瞬間も\n未来にはかけがえのない思い出に\nなっていることでしょう");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (0, 4, "", 16, 0, 384, "キャル", 106001, 80005, 0, 0, "だからそんな顔しないの\nほら、お祝いの準備、進めるわよ！");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (2, 4, "", 12, 0, 385, "シェフィ", 106401, 80005, 0, 0, "みんな…そうね\n最高のお祝いにして\n最高の思い出にしましょう！");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (3, 5, "", 13, 0, 386, "ペコリーヌ", 105801, 80005, 0, 0, "3.5周年まで、あと10日！\nもうすぐですよー！\n楽しみすぎて、やばいですね！");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (3, 5, "", 14, 0, 387, "ペコリーヌ", 105801, 80005, 0, 0, "そういえば…たくさんのおもちゃが\n子どもたちを襲うっていう\n騒動もありましたね…\nなんでも勝手に動き出したとか！");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (3, 5, "", 15, 0, 388, "ペコリーヌ", 105801, 80005, 0, 0, "学校や孤児院とかに\nちっちゃなおもちゃが乗り込んで\n暴れたみたいですよ！");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (0, 5, "", 17, 0, 389, "キャル", 106001, 80005, 0, 0, "暴れたって言っても\n所詮はおもちゃじゃない\nどうせちっさいんでしょ？");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (0, 5, "", 18, 0, 390, "キャル", 106001, 80005, 0, 0, "だったら魔法で\n全部ぶっ飛ばせばいいじゃない！\n大したことないわよ！");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (2, 5, "", 13, 0, 391, "シェフィ", 106401, 80005, 0, 0, "キャルってば…\n相手は子どもが\n大事にしてる物なのよ…？");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (1, 5, "", 13, 0, 392, "コッコロ", 105901, 80005, 0, 0, "乱暴な発言は\nめっ、でございますよ？\n子どもの教育に悪影響を\n与えてしまいますから…");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (3, 5, "", 16, 0, 393, "ペコリーヌ", 105801, 80005, 0, 0, "キャルちゃんだって\n意外と猫グッズとか\nたっくさん集めてますよね？\nもしその子たちが暴れたら…？");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (0, 5, "", 19, 0, 394, "キャル", 106001, 80005, 0, 0, "う、うっさいわね！\n意外とか言うな！\n…ま、まあ確かに正面切って\n魔法でぶっ飛ばせないかもね…");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (3, 5, "", 17, 0, 395, "ペコリーヌ", 105801, 80005, 0, 0, "あはは☆\nキャルちゃんのそういうところ\n好きですよ♪");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (3, 5, "", 18, 0, 396, "ペコリーヌ", 105801, 80005, 0, 0, "そんなキャルちゃんに猫グッズを\nプレゼントしちゃいますね！\n一部で流行っていた、たい焼き屋の\nおまけフィギュアですよ♪");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (3, 5, "", 19, 0, 397, "ペコリーヌ", 105801, 80005, 0, 0, "乱暴に扱ったりしないでくださいね\nひとりでに暴れ出しちゃうかも\nしれませんから！");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (2, 6, "", 4, 0, 398, "カリン", 190801, 80005, 0, 0, "3.5周年まであと９日\nここでみなさんに\nビックニュースですよ！");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (2, 6, "", 5, 0, 399, "カリン", 190801, 80005, 0, 0, "3.5周年を祝う生放送に\n去年と同様【美食殿】の\nみなさんにご出演いただくことが\n決定しましたー！");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (1, 6, "", 20, 0, 400, "キャル", 106001, 80005, 0, 0, "…えっ！？");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (3, 6, "", 20, 0, 401, "ペコリーヌ", 105801, 80005, 0, 0, "本当ですか！？\nそれじゃ今から張り切って\n生放送中に食べる魔物料理を\n作らなくちゃですね☆");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (0, 6, "", 14, 0, 402, "シェフィ", 106401, 80005, 0, 0, "いや…がんばるところは\nそこじゃないような…\nというか去年も出演してたのね\nすごいじゃない！");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (4, 6, "", 14, 0, 403, "コッコロ", 105901, 80005, 0, 0, "はい。とても緊張しますが\nやりがいのある大役です\n一緒にがんばりましょうね\nシェフィさま");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (0, 6, "", 15, 0, 404, "シェフィ", 106401, 80005, 0, 0, "わ、私も出るの！？　でも…\n私も【美食殿】の一人だものね\nそれなら今からしっかり準備をして\nコンディションを整えないと…");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (1, 6, "", 21, 0, 405, "キャル", 106001, 80005, 0, 0, "ふふん♪\n生放送直前のカチコチになった\nシェフィの姿が楽しみだわ！");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (3, 6, "", 21, 0, 406, "ペコリーヌ", 105801, 80005, 0, 0, "去年のキャルちゃんは\n緊張しすぎてずっと震えて\nかわいかったですもんね！\n今年もあの姿が見たいです！");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (1, 6, "", 22, 0, 407, "キャル", 106001, 80005, 0, 0, "ぶっ殺すぞ！？");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (2, 6, "", 6, 0, 408, "カリン", 190801, 80005, 0, 0, "というわけで\n『プリンセスコネクト！\nRe:Dive』の魅力を\nお伝えする生放送をお楽しみに♪");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (1, 7, "", 15, 0, 409, "コッコロ", 105901, 80005, 0, 0, "3.5周年まであと８日\nでございますよ\n楽しみですね、主さま");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (0, 7, "", 23, 0, 410, "キャル", 106001, 80005, 0, 0, "そういえばあんた\n夏休みの宿題は\nきちんとやってるの？");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (2, 7, "", 16, 0, 411, "シェフィ", 106401, 80005, 0, 0, "宿題…学校に通うのも\n楽しいことばかりじゃ\nないのね");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (3, 7, "", 22, 0, 412, "ペコリーヌ", 105801, 80005, 0, 0, "あれ？　そういえば\n少し前にルーセント学院で\n何かあったような…");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (0, 7, "", 24, 0, 413, "キャル", 106001, 80005, 0, 0, "ああ、始業式の日に\n大捕り物があったって\n話題になってたわね");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (2, 7, "", 17, 0, 414, "シェフィ", 106401, 80005, 0, 0, "夏休みを終わらせないって\n騒いでたっていう話？\nあれ本当なの？\n都市伝説だと思ってたわ");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (1, 7, "", 16, 0, 415, "コッコロ", 105901, 80005, 0, 0, "その一件ならよく存じ上げて\nおります。ですから主さま\n次の機会にはわたくしと一緒に\nがんばりましょう");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (2, 7, "", 18, 0, 416, "シェフィ", 106401, 80005, 0, 0, "楽しそう…私も一緒にやりたいな\nママ…じゃ、じゃなくて！\nコッコロさん、私もまざっていい？");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (1, 7, "", 17, 0, 417, "コッコロ", 105901, 80005, 0, 0, "もちろんでございます\n仲良くお勉強いたしましょう");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (0, 7, "", 25, 0, 418, "キャル", 106001, 80005, 0, 0, "しれっと教育ママが\n生まれてる…？");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (3, 7, "", 23, 0, 419, "ペコリーヌ", 105801, 80005, 0, 0, "お勉強は大切ですよ！\nキャルちゃんも一緒に\nがんばりましょう！");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (0, 7, "", 26, 0, 420, "キャル", 106001, 80005, 0, 0, "え～～～～！？");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (0, 8, "", 27, 0, 421, "キャル", 106001, 80005, 0, 0, "3.5周年まであと７日〜♪\nふふ～ん♪\nふんふふ～ん♪");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (2, 8, "", 19, 0, 422, "シェフィ", 106401, 80005, 0, 0, "…\nねぇコッコロさん\nキャル、どうしちゃったの？");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (1, 8, "", 18, 0, 423, "コッコロ", 105901, 80005, 0, 0, "とてもご機嫌そうに\n鼻歌を歌ってらっしゃいますね\n耳も尻尾もリズミカルに\n揺れて…ノリノリでございます");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (3, 8, "", 24, 0, 424, "ペコリーヌ", 105801, 80005, 0, 0, "あれはですね！\nカルミナのみなさんの\nサマーライブのチケットが\n手に入ったからなんですよ♪");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (2, 8, "", 20, 0, 425, "シェフィ", 106401, 80005, 0, 0, "ええっ！？\nあのライブのチケットって確か\n入手困難だったんじゃ…");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (0, 8, "", 28, 0, 426, "キャル", 106001, 80005, 0, 0, "ふふふふ～ん♪\nしゃいにんぐふゅ～ちゃ～♪");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (1, 8, "", 19, 0, 427, "コッコロ", 105901, 80005, 0, 0, "なるほど…\nキャルさまがあのように\nなってしまうのも頷けますね");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (2, 8, "", 21, 0, 428, "シェフィ", 106401, 80005, 0, 0, "…カルミナの\n『Shining Future』\nの中に、シャイニングフューチャー\nって歌詞はなかったはずだけど…");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (0, 8, "", 29, 0, 429, "キャル", 106001, 80005, 0, 0, "ふんふ…はっ！？\nあっ、あんたたち！\nなに人の鼻歌を\n勝手に聞いてるのよ！？");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (0, 8, "", 30, 0, 430, "キャル", 106001, 80005, 0, 0, "こっ、これは別に\nカルミナの曲じゃなくて…\nあたしのオリジナルソングよ！\n聞いたらお金取るわよっ！？");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (3, 8, "", 25, 0, 431, "ペコリーヌ", 105801, 80005, 0, 0, "えへへ、キャルちゃん\nカルミナのサマーライブ\n思いっきり楽しみましょうね☆");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (0, 8, "", 31, 0, 432, "キャル", 106001, 80005, 0, 0, "も～っ！\n生暖かい目で見るな～～！\nぶっ殺すわよ～～～！");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (0, 9, "", 22, 0, 433, "シェフィ", 106401, 80005, 0, 0, "3.5周年まであと６日\n３人も言ってたけど\nあっという間だったわね");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (0, 9, "", 23, 0, 434, "シェフィ", 106401, 80005, 0, 0, "…えっ？\n生放送の意気込み！？\n突然なに！？");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (0, 9, "", 24, 0, 435, "シェフィ", 106401, 80005, 0, 0, "ええと…\nとにかく失敗しないように\n台本たくさん読んで…\nそれから…");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (0, 9, "", 25, 0, 436, "シェフィ", 106401, 80005, 0, 0, "えっ！？\nトラブルがあったら\nどうするのかって！？\nそ、それは…！");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (0, 9, "", 26, 0, 437, "シェフィ", 106401, 80005, 0, 0, "とにかく落ち着いて\nスタッフさんの指示を聞いて…");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (0, 9, "", 27, 0, 438, "シェフィ", 106401, 80005, 0, 0, "それから、それから…！\nぅ、ぅぅっ…！");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (0, 9, "", 28, 0, 439, "シェフィ", 106401, 80005, 0, 0, "―びえぇぇ～んっ！！！");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (1, 9, "", 20, 0, 440, "コッコロ", 105901, 80005, 0, 0, "どうされましたか、シェフィさま");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (0, 9, "", 29, 0, 441, "シェフィ", 106401, 80005, 0, 0, "ううっ…ひっく…\nママッ…！");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (1, 9, "", 21, 0, 442, "コッコロ", 105901, 80005, 0, 0, "よしよし、緊張されてるのですね\nママが傍におりますよ\n主さま、少々お待ちくださいませ");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (1, 9, "", 22, 0, 443, "コッコロ", 105901, 80005, 0, 0, "…ふぅ\nシェフィさま\n生放送への意気込み\nお話しできそうですか？");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (0, 9, "", 30, 0, 444, "シェフィ", 106401, 80005, 0, 0, "…ううっ\n恥ずかしすぎて\nもう生放送出られない…");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (0, 10, "", 23, 0, 445, "コッコロ", 105901, 80005, 0, 0, "主さま\n3.5周年まであと５日\nでございます");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (0, 10, "", 24, 0, 446, "コッコロ", 105901, 80005, 0, 0, "ですがその前に\n生放送がありますね");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (0, 10, "", 25, 0, 447, "コッコロ", 105901, 80005, 0, 0, "…生放送に向けた\n意気込みでございますか？");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (0, 10, "", 26, 0, 448, "コッコロ", 105901, 80005, 0, 0, "もちろんわたくしは\n主さまのために\n全身全霊を込めて\n楽しい時間をご提供いたします");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (0, 10, "", 27, 0, 449, "コッコロ", 105901, 80005, 0, 0, "…と、意気込んでみましたが\nうまくできるか少し不安です\n声が小さくなったり\n間違えてしまったらどうしようと…");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (0, 10, "", 28, 0, 450, "コッコロ", 105901, 80005, 0, 0, "ですがわたくしは\n一人ではありません\n【美食殿】のみなさまが\nおります");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (0, 10, "", 29, 0, 451, "コッコロ", 105901, 80005, 0, 0, "どんな困難も\nみなさまと一緒なら\n乗り越えられると\nわたくし、確信しております");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (0, 10, "", 30, 0, 452, "コッコロ", 105901, 80005, 0, 0, "それに今回はシェフィさまも\nご参加されるわけですし\nママとしてお手本に\nならねばなりませんね");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (0, 10, "", 31, 0, 453, "コッコロ", 105901, 80005, 0, 0, "主さま。3.5周年も\n食卓を囲んでいる時のような\n楽しい思い出を\n一緒に作りましょうね");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (0, 11, "", 26, 0, 454, "ペコリーヌ", 105801, 80005, 0, 0, "3.5周年まであと４日！\nやばいですね☆");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (1, 11, "", 32, 0, 455, "キャル", 106001, 80005, 0, 0, "はいはい、やばいわね\nというかもうすぐ生放送だけど\nあんた準備はできてるの？");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (0, 11, "", 27, 0, 456, "ペコリーヌ", 105801, 80005, 0, 0, "ばっちりオイッスー☆　ですよ！\n『王家の装備』も全開です！");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (0, 11, "", 28, 0, 457, "ペコリーヌ", 105801, 80005, 0, 0, "あとは前回を超える\n最高のオイッスー☆　を\nお届けできるように\n練習あるのみですかね！");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (0, 11, "", 29, 0, 458, "ペコリーヌ", 105801, 80005, 0, 0, "キャルちゃんは\nどうなんですか？\nオイッスー☆　を\n毎日ちゃんと練習してますか？");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (1, 11, "", 33, 0, 459, "キャル", 106001, 80005, 0, 0, "はぁ！？　なんであたしまで\nその変なあいさつを練習しないと\nいけないのよ！");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (0, 11, "", 30, 0, 460, "ペコリーヌ", 105801, 80005, 0, 0, "もしかしてやってないんですか？\nダメですよキャルちゃん！\nシェフィちゃんだってちゃんと\n毎日練習してるのに！");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (0, 11, "", 31, 0, 461, "ペコリーヌ", 105801, 80005, 0, 0, "こうなったらわたしがキャルちゃん\nにオイッスー☆　の『オ』から\nしっかり教えてあげないと！");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (0, 11, "", 32, 0, 462, "ペコリーヌ", 105801, 80005, 0, 0, "オイッスー☆　の『オ』は\n口を大きく開いて〜\nドラゴンの骨つき肉に\nかぶりつく直前をイメージして〜");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (1, 11, "", 34, 0, 463, "キャル", 106001, 80005, 0, 0, "だからあたしはやるなんて一言も…");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (0, 11, "", 33, 0, 464, "ペコリーヌ", 105801, 80005, 0, 0, "オイッスー☆");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (1, 11, "", 35, 0, 465, "キャル", 106001, 80005, 0, 0, "聞きなさいっての！！");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (2, 12, "", 31, 0, 466, "シェフィ", 106401, 80005, 0, 0, "3.5周年まであと３日…\nそして生放送は、明日…");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (2, 12, "", 32, 0, 467, "シェフィ", 106401, 80005, 0, 0, "もっと台本を\n読み込んでおかないと…\nあと発声練習も…");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (2, 12, "", 33, 0, 468, "シェフィ", 106401, 80005, 0, 0, "おいっす！\n…こうじゃなかったわね\nええと確か…");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (2, 12, "", 34, 0, 469, "シェフィ", 106401, 80005, 0, 0, "うう…あんなに練習したのに\nこれじゃみんなに迷惑かけちゃう…");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (2, 12, "", 35, 0, 470, "シェフィ", 106401, 80005, 0, 0, "【美食殿】の一員として\n認められるように\n頑張らないといけないのに\nよし、もう一度…");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (3, 12, "", 34, 0, 471, "ペコリーヌ", 105801, 80005, 0, 0, "やってますねシェフィちゃん！");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (0, 12, "", 36, 0, 472, "キャル", 106001, 80005, 0, 0, "なによ、考えることは\nみんな同じってこと？");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (1, 12, "", 32, 0, 473, "コッコロ", 105901, 80005, 0, 0, "ふふ。シェフィさま\nよろしければ\n仲間に入れてください\n一緒にやればきっとうまくできます");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (2, 12, "", 36, 0, 474, "シェフィ", 106401, 80005, 0, 0, "みんな…もちろんよ！");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (3, 12, "", 35, 0, 475, "ペコリーヌ", 105801, 80005, 0, 0, "それじゃ明日の生放送に向けて\n一緒に練習がんばりましょう☆");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (2, 13, "", 7, 0, 476, "カリン", 190801, 80005, 0, 0, "3.5周年まであと２日と\n迫った本日は…\nいよいよ生放送です！");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (2, 13, "", 8, 0, 477, "カリン", 190801, 80005, 0, 0, "【美食殿】のみなさんが\n準備に入られていますので\nそれぞれ繋いでみましょう！\nまずはペコリーヌさんです！");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (3, 13, "", 36, 0, 478, "ペコリーヌ", 105801, 80005, 0, 0, "今日もオイッスー☆\nみんなで一緒に\nオイッスー☆");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (2, 13, "", 9, 0, 479, "カリン", 190801, 80005, 0, 0, "お手本になるような\n発声練習ですね！\nそれでは続いてコッコロさん");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (4, 13, "", 33, 0, 480, "コッコロ", 105901, 80005, 0, 0, "はじめちょろちょろ\nなかぱっぱ～♪\n生放送前にみなさまで\n食卓を囲んで英気を養いましょう");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (2, 13, "", 10, 0, 481, "カリン", 190801, 80005, 0, 0, "さすが【美食殿】のママですね！\nそしてキャルさんは…");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (1, 13, "", 37, 0, 482, "キャル", 106001, 80005, 0, 0, "大丈夫…大丈夫…\nあたしは大丈夫…");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (2, 13, "", 11, 0, 483, "カリン", 190801, 80005, 0, 0, "す、すごく震えてますけど\n大丈夫でしょうか…？\nそして今回初参加となる\n期待の新人シェフィさん！");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (0, 13, "", 37, 0, 484, "シェフィ", 106401, 80005, 0, 0, "あうー？");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (4, 13, "105901,34,106001,38,190801,12", 37, 0, 485, "みんな", 105801, 80005, 0, 1, "あ…");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (1, 13, "", 39, 0, 486, "キャル", 106001, 80005, 0, 0, "ちょ、ちょっとシェフィ！？\nなに赤ちゃん返りしてん―\nあ痛ぁっ！\n噛んだわこいつーっ！");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (4, 13, "", 35, 0, 487, "コッコロ", 105901, 80005, 0, 0, "シェフィさま\n緊張しすぎて\nしまったのでしょうね…\nおーよしよし…");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (3, 13, "", 38, 0, 488, "ペコリーヌ", 105801, 80005, 0, 0, "シェフィちゃん！\nそういう時は手のひらに\n好きな文字を書いて\n食べちゃうといいですよ！");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (2, 13, "", 13, 0, 489, "カリン", 190801, 80005, 0, 0, "…ええと、現場からは以上です！\n生放送はもうすぐ！\n特別なお知らせもありますので\nどうぞお楽しみに！");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (2, 14, "", 38, 0, 490, "シェフィ", 106401, 80005, 0, 0, "3.5周年の記念日も\nいよいよ明日ね\n…って、あれ？");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (3, 14, "", 39, 0, 491, "ペコリーヌ", 105801, 80005, 0, 0, "記念日はこの森へ行きませんか！？\nすっごく美味しいお肉が\nとれるんです☆");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (0, 14, "", 40, 0, 492, "キャル", 106001, 80005, 0, 0, "うげ、またあの魔物？\nさすがに今度は\n丸焼きとかはやめてよね…\n見た目がヤバすぎるし");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (1, 14, "", 36, 0, 493, "コッコロ", 105901, 80005, 0, 0, "ふふ、キャルさまもだいぶ\n魔物肉に慣れてきたようですね\n調理ならばわたくしに\nお任せください♪");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (2, 14, "", 39, 0, 494, "シェフィ", 106401, 80005, 0, 0, "みんな、何をしているの？\nなんだか、\n不穏な単語が聞こえたんだけど…");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (3, 14, "", 40, 0, 495, "ペコリーヌ", 105801, 80005, 0, 0, "シェフィちゃん！\n明日の食べ尽くしツアーの\n相談をしてたんですよ！");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (1, 14, "", 37, 0, 496, "コッコロ", 105901, 80005, 0, 0, "はい。明日は【美食殿】の\n一員となったシェフィさまと一緒に\n初めて記念日を過ごすのですから\n特別なコース料理を用意しませんと");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (0, 14, "", 41, 0, 497, "キャル", 106001, 80005, 0, 0, "ふふん♪\n猫の毛も逆立つような\nあれこれを食べさせられるから\n覚悟しておいたほうがいいわよ？");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (2, 14, "", 40, 0, 498, "シェフィ", 106401, 80005, 0, 0, "へ、へぇ…");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (3, 14, "", 41, 0, 499, "ペコリーヌ", 105801, 80005, 0, 0, "期待しててくださいね！\nシェフィちゃんとあなたに\n『おいちー！』って喜んでもらえる\n最高のごちそうを準備しますから☆");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (2, 14, "", 41, 0, 500, "シェフィ", 106401, 80005, 0, 0, "ええと…その…うーんと…\nわ、分かったわ\n私も【美食殿】の一員だもの");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (2, 14, "", 42, 0, 501, "シェフィ", 106401, 80005, 0, 0, "それにあなたも一緒みたいだし\n最後までがんばってみるわ…！");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (3, 15, "", 42, 0, 502, "ペコリーヌ", 105801, 80005, 0, 0, "それではいつものあれを\nやりましょう！\n準備はいいですかっ？\n…いっきますよー！");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (1, 15, "", 42, 0, 503, "キャル", 106001, 80005, 0, 0, "祝！");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (4, 15, "", 38, 0, 504, "コッコロ", 105901, 80005, 0, 0, "3.5周年！");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (0, 15, "", 43, 0, 505, "シェフィ", 106401, 80005, 0, 0, "おめでとうございます！");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (2, 15, "", 14, 0, 506, "カリン", 190801, 80005, 0, 0, "この日を迎えられたのも\nあなたが『プリンセスコネクト！\nRe:Dive』を遊んでくれている\nおかげです！");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (2, 15, "", 15, 0, 507, "カリン", 190801, 80005, 0, 0, "ということで\nみなさんからあなたへ一言ずつ\n感謝の言葉をどうぞ！");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (3, 15, "", 43, 0, 508, "ペコリーヌ", 105801, 80005, 0, 0, "感謝の言葉ですか？　わたしは\n毎日あなたに感謝してますよ\n【美食殿】の仲間になってくれて…\n一緒にごはんを食べてくれて…");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (3, 15, "", 44, 0, 509, "ペコリーヌ", 105801, 80005, 0, 0, "なにより今でもわたしをぺコリーヌ\nって呼んでくれてありがとうござい\nます。これからもわたしはあなたの\nぺコリーヌです！　やばいですね☆");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (1, 15, "", 43, 0, 510, "キャル", 106001, 80005, 0, 0, "えっ！？　今度はあたし！？\n感謝って…まぁ、そうね…\nあんたにはあたしが\n辛くて苦しい時に助けてもらって…");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (1, 15, "", 44, 0, 511, "キャル", 106001, 80005, 0, 0, "でもおかげで色々吹っ切れたわ！\nもしあんたが困ってたら今度は\nあたしが助けてあげるから\nその時はちゃんと言いなさいよ！");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (0, 15, "", 44, 0, 512, "シェフィ", 106401, 80005, 0, 0, "ええと…次は私ね\n実はよく覚えてないのだけど\n空から落ちてきた私を受け止めて\nくれたのはあなたなのでしょう？");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (0, 15, "", 45, 0, 513, "シェフィ", 106401, 80005, 0, 0, "最初に私を見つけてくれたのが\nあなたで良かったって思ってるの\nおかげで私は居場所を見つけたから\nあなたがくれたもの、大切にするわ");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (4, 15, "", 39, 0, 514, "コッコロ", 105901, 80005, 0, 0, "では最後にわたくしから…\nわたくしは主さまの元を離れた日…\nこのように記念日をお祝いする\nことは二度とないと思っていました");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (4, 15, "", 40, 0, 515, "コッコロ", 105901, 80005, 0, 0, "ですが、主さまはわたくしを\n迎えにきてくださり、今もこうして\nおそばにおいてくださっています\nわたくしにとって毎日が記念日です");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (4, 15, "", 41, 0, 516, "コッコロ", 105901, 80005, 0, 0, "わたくしたちの物語は\nまだ続いていきます\nこれからも一緒にページを\n作っていきましょうね");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (3, 15, "", 45, 0, 517, "ペコリーヌ", 105801, 80005, 0, 0, "それじゃ\nいつものあれでしめますよ！\nみんなで一緒に、さんはい☆");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (4, 15, "105901,42,106001,45,106401,46,190801,16", 46, 0, 518, "みんな", 105801, 80005, 0, 1, "これからも\nよろしくおねがいします！");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (1, 0, "", 1, 1, 519, "カリン", 190804, 60003, 0, 0, "新年を迎え、新たに始まる一日を\nおみくじで占ってみませんか？\n良い運勢であるほど、\n沢山のプレゼントが貰えますよ♪");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (2, 0, "", 0, 1, 520, "", 0, 60003, 1, 0, "今日の運勢は姫吉！　どんな不可能も可能にできちゃう！　　　　仲間と食卓を囲めばさらに運気上昇よ！　ただし魔物料理以外！");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (2, 0, "", 0, 1, 521, "", 0, 60003, 1, 0, "今日の運勢は姫吉！　やること全てが最高潮！　やばいですね☆　ラッキーアイテムはおにぎり！　お腹一杯で幸せが続くでしょう！");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (2, 0, "", 0, 1, 522, "", 0, 60003, 1, 0, "今日の運勢は姫吉！　羽が生えたように飛躍できる絶好調の運気！新しいことに挑戦するなら今しかないわ！　やってみましょう！");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (2, 0, "", 0, 1, 523, "", 0, 60003, 1, 0, "今日の運勢は姫吉！　精霊も新年の幸福をお祝いしています！　　主さまの笑顔が見られて、わたくしも幸せいっぱいでございます♪");
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (2, 0, "", 0, 2, 524, "", 0, 60003, 1, 0, "今日の運勢は姫吉！　やること全てが上手くいく最高の一日！　　あなたの活躍に先生もにっこりです。いい子いい子♪");
